INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("1", "საავტომობილო პარკი", "", "", "საავტომობილო", "N", "", "პარკი", "S", "C", "", "განსაკუთრებით სოფლად არსებობს საბჭოთა დროინდელი <b>საავტომობილო პარკი</b>. ", "გაუმართავი შუქნიშნები, უაზროდ დახაზული გზები ჩვენთან <b>საავტომობილო პარკი</b> უფრო სწრაფად იზრდება, ვიდრე გზების გამტარუნარიანობა. ", "...სადაც ნათქვამი იყო, რომ საქართველოს <b>საავტომობილო პარკი</b> მალე ელექტრომობილებით შეივსება. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("2", "იღბლიანი ბილეთი", "", "", "იღბლიანი", "A", "", "ბილეთი", "S", "PC", "", "ზედიზედ მესამედ იტალიელებმა ვერ შეძლეს ამ ლატარიის <b>იღბლიანი ბილეთი</b> ეპოვათ. ", "აშშ-ში, ლატარიაში გამარჯვებულს 'იღბლიანი' ბილეთი მაღაზიაში დარჩა. ", "თინათინ ნადიბაიძემ მის ცხოვრებაში ყველაზე <b>იღბლიანი ბილეთი</b> გორში, სტალინის 11-ში მდებარე ლატარიის ჯიხურში სახლში მიმავალმა გზად შეიძინა და ვერც კი იფიქრებდა, რომ ეს შენაძენი მის ცხოვრებაში ყველაზე მომგებიანი აღმოჩნდებოდა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("3", "მეწველი ძროხა", "", "", "მეწველი", "A", "", "ძროხა", "S", "NC", "", "რა მოხდა და, იმ დაბაში ისეთი <b>მეწველი ძროხა</b> არ გამოდგა მეორე. ", "მიპასუხე, ერთხელ მაინც დამცდა ვალზე სიტყვა?! <b>მეწველი ძროხა</b> გგონივარ თუ რა არის, ვერ გავიგე … – ხელებს უცნაურად იქნევდა ირაკლი. ", "რა მოხდა და, იმ დაბაში ისეთი <b>მეწველი ძროხა</b> არ გამოდგა მეორე. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("4", "პატიოსანი თამაში", "", "", "პატიოსანი", "A", "", "თამაში", "S", "C", "", "მთავარი სულის სრულყოფა კი არაა, არამედ „<b>პატიოსანი თამაში</b>”. ", "უნდა ითქვას, რომ ამ ახალგაზრდებმა ნოემბრის მოვლენებისას კულისებს მიღმა არცთუ <b>პატიოსანი თამაში</b>", "იქნებ არასწორადაა ეს ტერმინი გადმოთარგმნილი, ისე, როგორც მე-2 მუხლში „<b>პატიოსანი თამაში</b>”. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("5", "განტევების ვაცი", "", "", "განტევების", "N", "", "ვაცი", "S", "NC", "", "ეგონა მამასთან დარჩებოდი. ნახა <b>განტევების ვაცი</b>. ", "პაინის თქმით, რუსეთის პრეზიდენტს <b>განტევების ვაცი</b> სჭირდება.  ", "გენერალი რომან დუმბაძე – მოღალატე ოფიცერი თუ <b>განტევების ვაცი</b>? ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("6", "ჯაჭვური რეაქცია", "", "", "ჯაჭვური", "A", "", "რეაქცია", "S", "PC", "", "ემუქრება თუ არა გაზრდა თბილისელთა სატელეფონო გადასახადებს <b>ჯაჭვური რეაქცია</b> გამოიწვია ფასთწარმოქმნის სისტემაში. ", "ისინი კითხულობდნენ ჩვენს ანგარიშებს და პოსტებს ფეისბუკზე. ერთგვარი <b>ჯაჭვური რეაქცია</b> მოხდა.  ", "ამას მოყვა მეტად საინტერესო <b>ჯაჭვური რეაქცია</b>. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("7", "საველე სამუშაოები", "", "", "საველე", "A", "", "სამუშაოები", "P", "C", "", "გადაღების სწავლება, გადაღებები, თემების შერჩევა, <b>საველე სამუშაოები</b> – ყველაფერი 6 დღეში მოხდა. ", "თავად აღწერის <b>საველე სამუშაოები</b> 2014 წლის 5-19 ნოემბერს ჩატარდება.  ", "NDI-მ <b>საველე სამუშაოები</b> 8 აგვისტოდან 10 სექტემბრის შუალედში ჩაატარა. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("8", "საფეხბურთო სეზონი", "", "", "საფეხბურთო", "A", "", "სეზონი", "S", "C", "", "1948 წლის <b>საფეხბურთო სეზონი</b> უკანასკნელი გამოდგა ჯეჯელავასთვის. ", "თვის ბოლოსთვის თითქმის მთელს ევროპაში სრულდება <b>საფეხბურთო სეზონი</b>.  ", "მალე არდადეგები დამთავრდება და განახლდება დროებით შეწყვეტილი <b>საფეხბურთო სეზონი</b>.  ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("9", "სუფთა წყალი", "", "", "სუფთა", "A", "", "წყალი", "S", "C", "", "(სტილი დაცულია) [ქალბატონის ხმა] <b>სუფთა წყალი</b> რომ იყოს, კიდევ ჯანდაბას. ", "იცით თუ არა, რომ სარეცხს ყველაზე უკეთესად <b>სუფთა წყალი</b> რეცხავს … ", "იცით, როგორ არის? კანალიზაციაში რაც უნდა დიდი რაოდენობით <b>სუფთა წყალი</b> გაურიო, ის მაინც ბინძური დარჩება.  ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("10", "კრიტიკული რეცენზია", "", "", "კრიტიკული", "A", "", "რეცენზია", "S", "PC", "", "„აგვისტოს 5 დღის” შესახებ <b>კრიტიკული რეცენზია</b> დაიბეჭდა „ვაშინგტონ პოსტშიც” 19 აგვისტოს. ", "ჩემი <b>კრიტიკული რეცენზია</b>  სწორედ ამ წიგნზე დაიწერა. ", "მხოლოდ „უოლსტრიტ ჯორნელში” დაიბეჭდა <b>კრიტიკული რეცენზია</b> ერთი ყოფილი აგენტისა...  ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("11", "მოჩვენებათა ქალაქი ", "", "", "მოჩვენებათა", "N", "", "ქალაქი", "S", "PC", "", "2005 წელს <b>მოჩვენებათა ქალაქი </b>ერთ-ერთ ყველაზე ლამაზ პეიზაჟად აღიარეს. ", "მას შემდეგ 42 წელი გავიდა, ვაროშა კი ხმელთაშუა ზღვის მოჩვენებების ქალაქად იქცა. ", "<b>მოჩვენებათა ქალაქი </b>- როგორ გამოიყურება ჩერნობილი კატასტროფიდან 28 წლის შემდეგ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("12", "უხილავი საზღვარი", "", "", "უხილავი", "A", "", "საზღვარი", "S", "NC", "", "მთის ირგვლივ შემოწერილია <b>უხილავი საზღვარი</b>, რომლის გადალახვის ნება უბრალო ხალხს არა აქვს.  ", "შუა ქუჩაში ცილინდრიანი კაცი გამოჩნდა, რომელმაც <b>უხილავი საზღვარი</b> გადაკვეთა. ", "სამასწავლებლოშიც გაავლეს თვალით <b>უხილავი საზღვარი</b>. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("13", "გამოუვალი მდგომარეობა", "", "", "გამოუვალი", "A", "", "მდგომარეობა", "S", "NC", "", "უფრო სწორად, არ არსებობს <b>გამოუვალი მდგომარეობა</b>.  ", "დიდ ბოდიშს ვიხდით, მაგრამ <b>გამოუვალი მდგომარეობა</b> გვაქვს და უნდა გვიშველოთ. ", "<b>გამოუვალი მდგომარეობა</b> ზამთრის რომელიღაც კურორტს კვლავ ათოვს. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("14", "უბრალო ხალხი", "", "", "უბრალო", "A", "", "ხალხი", "S", "NC", "", "ასე რომ, ღვთისმსახურების დროს ქართულად აღვლენილ ყველა ლოცვას <b>უბრალო ხალხი</b> ჩინებულად გებულობს.  ", "ჩვენ <b>უბრალო ხალხი</b> ვართ. ", "ჩვენ, <b>უბრალო ხალხი</b>, ამ ანგარიშებში არც ვერევით. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("15", "ბინძური ფული", "", "", "ბინძური", "A", "", "ფული", "S", "PC", "", "რეალურად ეს არის პატარკაციშვილის, ბერეზოვსკის და სხვათა ძალიან <b>ბინძური ფული</b>.  ", "სტუდენტები აცხადებენ, რომ მათ <b>ბინძური ფული</b> არ სჭირდებათ. ", "ან საქართველოს სასიცოცხლო ინტერესების უცხოელებზე გაყიდვით მიღებული <b>ბინძური ფული</b> სოროსიდან თუ მსოფლიო ბანკიდან. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("16", "ფაიფურის თიხა", "", "", "ფაიფურის", "N", "", "თიხა", "S", "C", "", "ქაღალდს სითეთრესა და გაუმჭვირვალობას <b>ფაიფურის თიხა</b> ანიჭებს. ", "პაპიემაშე, მაქმანი, მავთული, მძივი, ბისერი, <b>ფაიფურის თიხა</b> და კიდევ ათასი წვრილმანი. ", "", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("17", "ბინძური სიტყვა", "", "", "ბინძური", "A", "", "სიტყვა", "S", "PC", "", "...იქამდე ვერ მიხვდებიან იმასაც, რა არის თავისუფალი სიტყვა და რა – <b>ბინძური სიტყვა</b>.  ", "ბოლო წლებში იმდენი <b>ბინძური სიტყვა</b> მოვისმინეთ ამერიკულ ფილმებში თუ სხვა გადაცემებში... ", "რადგან უწვრთნელი ახალგაზრდობა ხშირად თავს ვერ იკავებს და შემთხვევას არ გაუშვებს ორაზროვანი <b>ბინძური სიტყვა</b> არ გააყოლოს, არ წაუმღეროს, ან ხელი არ წაატანოს. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("18", "მყარი დისკი", "", "", "მყარი", "A", "", "დისკი", "S", "PC", "", "კომპიუტერებს 80-გიგაბაიტიანი <b>მყარი დისკი</b> აქვთ და ისინი თანამგზავრული კავშირის მეშვეობით, ინტერნეტშია ჩართული. ", "ამდენივე ეღირება <b>მყარი დისკი</b> და ფლეშ მეხსიერება.  ", "დისკების მწარმოებელმა თუფპფეუ კომპანიამ წარმოადგინა ზწსლუე რფკვ ვკშმუ ახალი მინიატიურული <b>მყარი დისკი</b>. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("19", "კლიმატის ცვლილება", "", "", "კლიმატის", "N", "", "ცვლილება", "S", "PC", "", "თავდაპირველად ამ სამიტის თემა <b>კლიმატის ცვლილება</b> იყო. ", "მაგრამ <b>კლიმატის ცვლილება</b> ახლა ხდება”, – განაცხადა ბაროზუმ.  ", "ჯერ არავინ იცის რა იქნება და როგორ, მაგრამ ყველამ ვიცით, რომ <b>კლიმატის ცვლილება</b> რეალურია. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("20", "დისკ ჟოკეი", "", "", "დისკ", "N", "", "ჟოკეი", "S", "PC", "", "მსოფლიოში ცნობილი დისკ-ჟოკეი საკურორტო ქალაქის მოსახლეობისა და მისი სტუმრების წინაშე გამოვა.  ", "მასთან ერთად 6 აგვისტოს კლუბის სცენაზე დაუკრავს მისი რუსი კოლეგა დიჯეი D.A.L.I., ასევე ქართველი დისკ-ჟოკეი ლაშა გურული. ", "მსოფლიოში აღიარებული გერმანელი <b>დისკ ჟოკეი</b> ცნობილია მისი ჰარმონიული ტექნო ჰანგებით. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("21", "აკადემიის ჯილდო", "", "", "აკადემიის", "N", "", "ჯილდო", "S", "PC", "", "ბედნიერი ვარ, რომ წილად მხვდა დიდი პატივი – მომენიჭა შვედეთის სამეფო <b>აკადემიის ჯილდო</b>. ", "...ხოლო ებრაისტიკაში გაწეული ღვაწლისათვის მას გადაეცა ისრაელის მეცნიერებათა <b>აკადემიის ჯილდო</b> – ალბერტ აინშტაინის მედალი. ", "თანაც, თუ დავაკვირდებით, შვედეთის <b>აკადემიის ჯილდო</b> თვისობრივად საკმაოდ უცნაური ფენომენია... ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("22", "საავტომობილო ზოლი", "", "", "საავტომობილო", "A", "", "ზოლი", "S", "C", "", "თბილისი (GBC) – ყირიმის ხიდის ყველა <b>საავტომობილო ზოლი</b> აღდგენილი და გახსნილია ავტოტრანსპორტისთვის. ", "ეს ურთულესი მონაკვეთია,  რადგან ავტობუსის ზოლის ჩატევა ისე, რომ თითო <b>საავტომობილო ზოლი</b> მაინც დარჩეს მანქანას, უკვე ჭირს.", "გარდა ამისა, დავით ნარმანიას განცხადებით, პეკინიდან ვაჟა-ფშაველასა და ყაზბეგის გამზირის კვეთებში მოეწყო უსაფრთხოების კუნძულები, ხოლო კალანდაძისა და პეკინის ქუჩების კუთხეში გაფართოვდა გზა და  დაემატა ერთი <b>საავტომობილო ზოლი</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("23", "მეცხრე ცა", "", "", "მეცხრე", "NUM", "", "ცა", "S", "PC", "", "<b>მეცხრე ცა</b> არის მართალთა, წმიდანთა ცა.", "„ჰერცოგი”, „კაპუცინი”, „კატა”, „თაგვი”, „მილი”, „პირველი ცა”, „მეორე ცა”, „<b>მეცხრე ცა</b>” – აი, პარიზულ ქალთა ქუდების სახელების მცირე ნაწილი.", "მაშინ არ ვამბობდით – ვინ ვისთან წევს, მერე ვისწავლეთ და იმ საწოლიდანაც <b>მეცხრე ცა</b> ჩანდა …", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("24", "თავებზე მონადირე", "", "", "თავებზე", "N", "", "მონადირე", "S", "PC", "", "ისეთი <b>თავებზე მონადირე</b>", "მაგრამ თუ მძარცვლები სინდისმა არ შეაწუხა და ასეთ ნაბიჯს არ გადადგამენ, მაშინ ლონდონელ „<b>თავებზე მონადირე</b>” პიტერ კენიონს ურჩევენ...", "მსოფლიოს ახალი მოვლენის, ნორვეგიელი მწერლის, იუ ნესბოს '<b>თავებზე მონადირე</b>' მალე ქართველ მკითხველსაც დაიპყრობს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("25", "არკადის თამაში", "", "", "არკადის", "N", "", "თამაში", "S", "PC", "", "FIFA ვერასოდეს ვერ შეედრება პეს 5 ,FIFა შI სტრატეგია არ არის და ჩვეულებრივი <b>არკადის თამაში</b> არის და საერთოდ ფეხბურთს სტრატეგია არ აქვს FIFა ში...", "თუ გსურთ ახალი <b>არკადის თამაში</b>, სადაც ფულის გამომუშავების შანსი გაქვთ…", "სხვათა შორის, ამ <b>არკადის თამაში</b> შესაძლებელია როგორც მარტო, ისე შიგნით.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("26", "კოქტეილის კაბა", "", "", "კოქტეილის", "N", "", "კაბა", "S", "PC", "", "...მოვლენებს არასწორად აფასებენ, – ამბობს ის, – მას აცვია <b>კოქტეილის კაბა</b>, რომელიც ამავე დროს წარმოადგენს საქმიან კაბას...", "ნანუკა ჟორჟოლიანის დიზაინერული ქუდი, მაია ასათიანის შავი <b>კოქტეილის კაბა</b> და „მხოლოდ ქართულის“ სხვა გამორჩეული ჩაცმულობები", "მაია ასათიანის შავი <b>კოქტეილის კაბა</b> ეკუთვნოდა დიზაინერ ნანა მელქაძეს, რომელიც ბოლო ორ სეზონზე ტელეწამყვანს აცმევს როგორც „პროფილში“, ასევე „მხოლოდ ქართულში“.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("27", "იურიდიული ფირმა", "", "", "იურიდიული", "A", "", "ფირმა", "S", "PC", "", "...საქართველოში სამდღიანი ვიზიტით ჩამოვიდა ბრიტანეთის ერთ-ერთი უმსხვილესი <b>იურიდიული ფირმა</b> „ნორტონ როუზი”. ", "ბორის ბერეზოვსკის ინტერესებს აღნიშნულ საკამათო სიტუაციაში <b>იურიდიული ფირმა</b> „კარტერ-რაქი” იცავს.", "Gornitzky & Co., ისრაელში არსებული <b>იურიდიული ფირმა</b>, რომელიც ასევე იცავს ფუქსის ინტერესებს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("28", "მძიმე ტვირთი", "", "", "მძიმე", "A", "", "ტვირთი", "S", "PC", "", "თითქოს <b>მძიმე ტვირთი</b> მომეხსნა.", "წაგლეჯაზე თვალებგამოპრაწული მოძღვარი! … <b>მძიმე ტვირთი</b>, რომლის შორს ყოფნას რჩეობენ!", "ტარომ გაიცინა, გლეხებს ფეხებთან დაუგდო <b>მძიმე ტვირთი</b>: – აჰა, წაიღეთ, ეს ბრინჯის ძნა ყველასათვის მიჩუქებია.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("29", "თაბაშირ მუყაოს ფილა", "", "", "თაბაშირ-მუყაოს", "N", "", "ფილა", "S", "C", "", "<b>თაბაშირ მუყაოს ფილა</b> ერთ-ერთი ყველაზე პოპულარული სამშენებლო მასალაა, რომელიც გამოიყენება კედლების, ჭერის და ტიხრების მშენებლობისას. ", "<b>თაბაშირ მუყაოს ფილა</b> “ნოვა”-ში სხვადასხვა ვარიანტებითაა წარმოდგენილი - ნესტგამძლე ფილა, ცეცხლგამძლე ფილა და სტანდარტული ფილა.", "ვენ ლაბორატორიაში გამოვცადეთ სხვადასხვა თურქული წარმოების თაბაშირმუყაოს ფილა, რომლებიც საქართველოს ბაზარზეა წარმოდგენილი.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("30", "სწრაფი კურსი", "", "", "სწრაფი", "A", "", "კურსი", "S", "PC", "", "სასაუბრო ინგლისურის <b>სწრაფი კურსი</b>", "ნებისმიერი ერთი უცხო ენის შემსწავლელი <b>სწრაფი კურსი</b> მხოლოდ 30 ლარად სასწავლო ცენტრისაგან `ენემი` + პირველი გაკვეთილი უფასოდ!", "<b>სწრაფი კურსი</b> მოიცავს კვირაში 3 გაკვეთილს თითო გაკვეთილი 1სთ 30 წუთი (ჯამში 3 კვირა)", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("31", "ცარიელი სიტყვები", "", "", "ცარიელი", "A", "", "სიტყვები", "P", "PC", "", "ეს რეალობაა და არა <b>ცარიელი სიტყვები</b>.", "ეს არ არის <b>ცარიელი სიტყვები</b>, ეს მართლა შესაძლებელია და რეალური საფრთხეა ამის…  ", "ვთქვათ ასე, რომ უკრაინის ბედი და მისი მომავალი ჩემთვის არ არის <b>ცარიელი სიტყვები</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("32", "ცუდი მაგალითი", "", "", "ცუდი", "A", "", "მაგალითი", "S", "PC", "", "მაგას ვგულისხმობდი, ბატონო არზნევ, როცა ვთქვი, <b>ცუდი მაგალითი</b> მისცა-მეთქი.", "ხშირად მიუთითებენ, რომ აჭარის შეკვეცილი ავტონომია <b>ცუდი მაგალითი</b> აღმოჩნდა სოხუმისა და ცხინვალისათვის.", "ეს სრულებითაც არ არის ყველაზე <b>ცუდი მაგალითი</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("33", "საკრედიტო ბარათი", "", "", "საკრედიტო", "A", "", "ბარათი", "S", "PC", "", "სესხის მიღება შეუძლია ყველას, ვისაც მოეპოვება საბანკო ანაგარიში, ანდა <b>საკრედიტო ბარათი</b> – მინიმუმ 25 დოლარი და მაქსიმუმ 1500.", "<b>საკრედიტო ბარათი</b> – ესაა სესხის აღების სწრაფი, თანამედროვე და მოხერხებული საშუალება.", "<b>საკრედიტო ბარათი</b> შეიძლება იყოს ელექტრონის, კლასიკისა და გოლდის ტიპის.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("34", "ბანანის რესპუბლიკა", "", "", "ბანანის", "N", "", "რესპუბლიკა", "S", "PC", "", "არ იცით, რა ქვეყანაში ვცხოვრობთ? კამბოჯაა, რა, <b>ბანანის რესპუბლიკა</b>. ", "ჩვენ აღარა ვართ <b>ბანანის რესპუბლიკა</b> და ამაზე ძალიან ნერვიულობს იქ ადგილობრივი ხელმძღვანელობა.", "საქართველო <b>ბანანის რესპუბლიკა</b> გახდება ინტერვიუ ქალთა პარტიის ლიდერ გუგული მაღრაძესთან.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("35", "ნიანგის ცრემლი", "", "", "ნიანგის", "N", "", "ცრემლი", "S", "PC", "", "აგერ კაცმა <b>ნიანგის ცრემლი</b> გადმოაღვარღვარა და ეს ორმოცი წლის ქალი, ლამის ფსიქიატრიულში მოხვდე.", "მეგობრის დაკავების გამო თვალს მოდენილი <b>ნიანგის ცრემლი</b>", "„ნიანგის ცრემლები“ – ბავშვის გონებით აღქმული იდიომების ორიგინალური ვიზუალიზაცია", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("36", "ლოტოსის პოზიცია", "", "", "ლოტოსის", "N", "", "პოზიცია", "S", "PC", "", "მედიტაციის სწორად შესრულებისთვის აუცილებელია თქვენს სხეულს მიანიჭოთ გარკვეული პოზიცია - <b>ლოტოსის პოზიცია</b>.", "ყველაზე სწორი <b>ლოტოსის პოზიცია</b> იქნება.", "ეს შეიძლება იყოს <b>ლოტოსის პოზიცია</b>, ან შეიძლება იყოს სკამი, სკამი ან მანქანის სავარძელი", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("37", "გაკოტრების წარმოება", "", "", "გაკოტრების", "N", "", "წარმოება", "S", "C", "", "...შპს ,,გიორგის’’ <b>გაკოტრების წარმოება</b> და გაუქმდეს რეაგისტრაცია სამეწარმეო რეესტრში.", "როგორც დადგინდა კვლევების მიხედვით, გაკოტრების ფრანგული სამართლისათვის სახასიათოა იყო <b>გაკოტრების წარმოება</b>, აღნიშნული სამართლის მიხედვით მხოლოდ კომერსანტი შეიძლება ყოფილიყო გაკოტრებაუნარიანი.", "შემდეგ კი, როგორც ეროსი კიწმარიშვილი, ირაკლი ოქრუაშვილი და სხვები აღწერენ, სქემის მიხედვით, რომელიც მათ ეროსი კიწმარიშვილმა მიაწოდა, დაიწყო <b>გაკოტრების წარმოება</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("38", "ელ.ფოსტის მისამართების სია", "", "", "ელ.ფოსტის", "N", "", "მისამართების", "S", "C", "", "აირჩიეთ ჩანართი დამატება სიაში და ჩადეთ შესაბამის ყუთში <b>ელ.ფოსტის მისამართების სია</b> და შემდეგ დააჭირეთ ღილაკს დამატება.", "წაიკითხეთ იმ ელ.ფოსტის პროგრამის სხვადასხვა ანგარიშებთან დაკავშირებული <b>ელ.ფოსტის მისამართების სია</b>.", "უბრალოდ შეიყვანეთ პირის სახელი და გვარი ვებსაიტის URL– თან ერთად, რომ მიიღოთ შესაბამისი <b>ელ.ფოსტის მისამართების სია</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("39", "მოქმედების ეპიცენტრი", "", "", "მოქმედების", "N", "", "ეპიცენტრი", "S", "NC", "", "უკვე 20 წელია, 14 აპრილს <b>მოქმედების ეპიცენტრი</b> დედაენის ძეგლია – მსოფლიოში ერთადერთი ძეგლი, რომელიც წიგნს მიეძღვნა.", "მოქმედების ეპიცენტრი ავღანეთისა და პაკისტანის საზღვრის მიმდებარე ტერიტორია გახდა.", "Fredsgatan 12-ი ქალაქის საუკეთესო რესტორანია, მაგრამ ზაფხულის თბილ საღამოს <b>მოქმედების ეპიცენტრი</b> მეზობლად მდებარე შენობის კიბეებზე გადაინაცვლებს ხოლმე, სადაც კლუბი F12 Terrassen-ია განლაგებული.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("40", "ეკონომიკური დახმარება", "", "", "ეკონომიკური", "A", "", "დახმარება", "S", "C", "", "მოუწოდებს ევროპის კავშირს და ამერიკის შეერთებულ შტატებს ქმედითი <b>ეკონომიკური დახმარება</b> გაუწიოს უკრაინის ხელისუფლებას.", "ევროკავშირი აპირებს, ბირთვული პროგრამის შეწყვეტის სანაცვლოდ, ირანს მნიშვნელოვანი <b>ეკონომიკური დახმარება</b> აღმოუჩინოს.", "ფელიშა მიიჩნევს, ერაყში ჯარების გაგზავნაზე უკეთესი იქნებოდა, ბუშს უფრო მეტი <b>ეკონომიკური დახმარება</b> აღმოეჩინა ერაყისთვის.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("41", "თაფლის ხაფანგი", "", "", "თაფლის", "N", "", "ხაფანგი", "S", "PC", "", "<b>თაფლის ხაფანგი</b> - როგორ ამზადებდა კგბ ჯაშუშ ქალებს კაცების შესაცდენად", "აქ ყველაზე მძლავრ იარაღად ცნობილი „<b>თაფლის ხაფანგი</b>“ ითვლება, რომელშიც ბევრი ცნობილი პიროვნება გაება.", "საიდან გაჩნდა ტერმინი „<b>თაფლის ხაფანგი</b>“, უცნობია. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("42", "დნობის წერტილი", "", "", "დნობის", "N", "", "წერტილი", "S", "NC", "", "ფერფლი შედგება კვარცის, რკინის, ალუმინის, მაგნეზიის, ბევრი ელემენტისაგან და ამ ფეფრლის <b>დნობის წერტილი</b> 1000-დან 1050-მდე გრადუსია ცელსიუსით.", "<b>დნობის წერტილი</b> ეხება ტემპერატურა, როდესაც ნივთიერება მყარი მდგომარეობიდან თხევად მდგომარეობაში გადადის.", "რკინის შენადნობები და მათი <b>დნობის წერტილი</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("43", "ბრილიანტის ქორწილი", "", "", "ბრილიანტის", "N", "", "ქორწილი", "S", "NC", "", "ხესედ ელიაჰუს სამეურვეო პირებმა აბრამ და როზა ბაქშებმა <b>ბრილიანტის ქორწილი</b> აღნიშნეს.", "გასული წლის ხანუქის დღეებში ცენტრმა ერთ წყვილს <b>ბრილიანტის ქორწილი</b> გადაუხადა.", "დედოფლისგან მილოცვა მიიღო ასევე იმ 280 ათასზე მეტმა წყვილმა, რომლებმაც აღნიშნეს <b>ბრილიანტის ქორწილი</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("44", "დღის ძილი", "", "", "დღის", "N", "", "ძილი", "S", "PC", "", "24 ივნისი, პარასკევი გვიან გავიღვიძე, მაგრამ <b>დღის ძილი</b> მაინც ვერასოდეს მიცვლის ღამისას.", "<b>დღის ძილი</b> სასარგებლოა გულისთვის, მიაჩნიათ ამერიკელ მეცნიერებს.", "ამბობენ, რომ <b>დღის ძილი</b> სასარგებლოა გულისთვისო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("45", "საბოლოო მომხმარებელი", "", "", "საბოლოო", "A", "", "მომხმარებელი", "S", "PC", "", "განაწილების და საცალო ვაჭრობის განცალკევების მიზნით ყველა <b>საბოლოო მომხმარებელი</b> უნდა გამრიცხველიანდეს და უნდა დაინერგოს სისტემები...", "ამ შემთხვევაში დაზარალებული ყველის <b>საბოლოო მომხმარებელი</b> რჩება.", "ყველაფერს <b>საბოლოო მომხმარებელი</b> იხდის.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("46", "საინკუბაციო პერიოდი", "", "", "საინკუბაციო", "A", "", "პერიოდი", "S", "C", "", "მეორე: შიდსის ვირუსის <b>საინკუბაციო პერიოდი</b> 5 და 10 წლამდე გრძელდებაო.", "გამოკვლევები მოწმობს, რომ <b>საინკუბაციო პერიოდი</b> დაახლოებით 10 დღე გრძელდება. ", "მალარიის დაავადების <b>საინკუბაციო პერიოდი</b> 7-10 დღეა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("47", "გაშლილი სივრცე", "", "", "გაშლილი", "A", "", "სივრცე", "S", "NC", "", "<b>გაშლილი სივრცე</b> მიყვარსო.", "მისი ორი თვალის <b>გაშლილი სივრცე</b> კი ოდენ მწარე ტირილის გემოს შეიგრძნობდა”.", "ავტორი გამოთქვამს მოსაზრებას, რომ რიყის არაჩვეულებრივი გარემო, <b>გაშლილი სივრცე</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("48", "ძრავის ოთახი", "", "", "ძრავის", "N", "", "ოთახი", "S", "PC", "", "<b>ძრავის ოთახი</b> ჩვეულებრივ მდებარეობს გემის შუა ან უკანა ნაწილში.", "6 ივნისის ღამეს რუსმა დამპყრობლებმა ააფეთქეს კახოვსკას ჰიდროელექტროსადგური, გაანადგურეს <b>ძრავის ოთახი</b> და თავად სადგური, მისი აღდგენა შეუძლებელია.", "ნავის <b>ძრავის ოთახი</b>, როგორც წესი, მკაცრიაამიტომ გირჩევთ რომ აირჩიოთ თქვენი სალონი, რათა თავიდან ავიცილოთ ძრავის რეზერვების რხევა მშვილდში. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("49", "საინფორმაციო ერა", "", "", "საინფორმაციო", "A", "", "ერა", "S", "PC", "", "პერსონალური კომპიუტერები, <b>საინფორმაციო ერა</b> და ინტერნეტი მისი პლატფორმა გახდა...", "<b>საინფორმაციო ერა</b> თავისთავად განაპირობებს გლობალიზმს, ხოლო გლობალიზმი, თავის მხრივ, აქსიომატური რეალობაა. ", "<b>საინფორმაციო ერა</b> დიდი ხანია, რაც არსებობს, მაგრამ ახლა პანდემიამ იძულებით მიუერთა ციფრულ ცხოვრებას საზოგადოების ის ნაწილი, რომელსაც ამ სიახლეების გარეშე სურდა ეცხოვრა მთელი ცხოვრების მანძილზე.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("50", "თვალის კანფეტი", "", "", "თვალის", "N", "", "კანფეტი", "S", "NC", "", "ალვესტერ მარტინი - მეტი ვიდრე უბრალოდ <b>თვალის კანფეტი</b>.", "ფერის კონტრასტი საკმარისია <b>თვალის კანფეტი</b> ნებისმიერ მომხმარებელს უწოდებენ", "ჩვენ მხოლოდ ამის მოლოდინი შეგვიძლია ჯო ბობ მოამზადა ჩვენთვის მოხმარებული <b>თვალის კანფეტი</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("51", "ტრავმის დრო", "", "", "ტრავმის", "N", "", "დრო", "S", "PC", "", "შემთხვევისა და <b>ტრავმის დრო</b> და ადგილი...", " ეს იყო სწრაფი გარდატეხებისა და <b>ტრავმის დრო</b>. ", "საფეხბურთო მატჩში დროის სამი ტიპი არსებობს: ძირითადი დრო, <b>ტრავმის დრო</b> და დამატებითი დრო. დამატებული დრო კომპენსირებული დროის სინონიმია. მნიშვნელოვანია გავიგოთ განსხვავება ამ ცნებებს შორის.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("52", "შიდა ვაჭრობა", "", "", "შიდა", "A", "", "ვაჭრობა", "S", "PC", "", "...ბაჟის დაწესება გაფართოებაზე მოლაპარაკებას გადადებს, რადგან <b>შიდა ვაჭრობა</b> ევროკავშირის ბირთვს წარმოადგენს.", "„გაზპრომის” აქციებით <b>შიდა ვაჭრობა</b> საკმაოდ მშვიდ ვითარებაში მიმდინარეობს.", "მიჩნეულია, რომ ანტიკურ ეპოქაში, შავი ზღვის რეგიონში მხოლოდ <b>შიდა ვაჭრობა</b> იყო განვითარებული.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("53", "ნომინალური ღირებულება", "", "", "ნომინალური", "A", "", "ღირებულება", "S", "NC", "", "აქციების რაოდენობა შეადგენს 587505, თითოეული აქციის <b>ნომინალური ღირებულება</b> არის 1 ლარი, რაც ჯამში შეადგენს 587505 ლარს.", "მონეტაზე დატანილია ქართულ და ინგლისურ ენებზე სიტყვა „საქართველო” და მონეტის <b>ნომინალური ღირებულება</b>.", "აქვე შევნიშნავ, რომ საპრივატიზაციო ფულის <b>ნომინალური ღირებულება</b> არაარსებითია.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("54", "მნიშვნელოვანი პერსონა", "", "", "მნიშვნელოვანი", "A", "", "პერსონა", "S", "NC", "", "წარმოდგენილია პოეტებიდან, ასევე, დავით ჩიხლაძე, ჩემთვის პირადად ძალიან <b>მნიშვნელოვანი პერსონა</b>.", "ჩვენი გუნდის ტექნიკურმა დირექტორმა მარკ ვოტუმ მატჩამდე მითხრა, რომ ძალიან <b>მნიშვნელოვანი პერსონა</b> ჩემი თამაშის საყურებლად ჩამოვიდა.", "პოპ-ვარსკვლავებიდან გასული წლის ყველაზე <b>მნიშვნელოვანი პერსონა</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("55", "სრული სურათი", "", "", "სრული", "A", "", "სურათი", "S", "PC", "", "ეს იქნებოდა <b>სრული სურათი</b> ხეტეს გლოვისა, მისი მოზარეობისა.", "ეს დადასტურდა გაკვეთით, რამაც ექსპერტიზას მისცა გულის დახანებული ორგანული მანკის <b>სრული სურათი</b>.", "ასეთი იყო ილია, ასე წარმომიდგება მე მისი სავსე და <b>სრული სურათი</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("56", "ღამის ბუ", "", "", "ღამის", "N", "", "ბუ", "S", "PC", "", "<b>ღამის ბუ</b> თუ 'დილის ტოროლა'?", "მონღოლების ხანი მუდამ დაატარებდა თან ოქროს გალიას, სადაც შავი <b>ღამის ბუ</b> ეჯდა, რადგან ასეთივე ფრინველმა ცხოვრება გადაურჩინა მონღოლების პირველ იმპერატორს – ჩინგიზხანს.", "ამასთან, თუ <b>ღამის ბუ</b> ხართ, რომელიც წონის დაკლებას აპირებს, არ ინერვიულოთ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("57", "მარადიული განსვენება", "", "", "მარადიული", "A", "", "განსვენება", "S", "PC", "", "... წლის შემდეგ უბოძოს მას ცათა სასუფეველში <b>მარადიული განსვენება</b>, მადლი და ნეტარება.", "ასე, რომ ამ ათასის წელიწადთა უთვალავი რიცხვით  მინიშნებულია აღდგომის შემდეგ წმინდანთა <b>მარადიული განსვენება</b>, რომელზეც  დაფარულად 'ათასი წლით' მიანიშნა'", "მისი აზრით, <b>მარადიული განსვენება</b> რომ არ იყოს, ფილოსოფიაც არ იარსებებდა – საკუთარი არსებობის სასრულობას რომ განიცდის ადამიანი, იგი თავისთავს უღრმავდება და ყოფიერების საიდუმლოებებზეც ფიქრდება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("58", "ორგანიზმის დროითი რიტმის დარღვევა", "", "", "ორგანიზმის", "N", "", "დროითი", "S", "NC", "", "გარდა სეზონური დეპრესიისა, სინათლის თერაპიით მკურნალობენ ისეთ პრობლემებს, როგორიცაა: ...  <b>ორგანიზმის დროითი რიტმის დარღვევა</b>.", "", "", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("59", "ბალანსის შენარჩუნება", "", "", "ბალანსის", "N", "", "შენარჩუნება", "S", "PC", "", "ან, საერთოდ, საჭიროა თუ არა არსებული <b>ბალანსის შენარჩუნება</b>. ", "ის გაწონასწორებულია და მათაც ეცადონ გადაცემაში ამ კოსმოსური <b>ბალანსის შენარჩუნება</b>. ", "ასე რომ, სააკაშვილს ამ <b>ბალანსის შენარჩუნება</b> გაუძნელდება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("60", "საპატრულო მანქანა", "", "", "საპატრულო", "A", "", "მანქანა", "S", "NC", "", "ის იყო მცხეთას გასცდა და ახალ დაბეტონებულ გზაზე გავიდა, რომ <b>საპატრულო მანქანა</b> წამოეწია და უბრძანა გაეჩერებინა.", "ახალი <b>საპატრულო მანქანა</b>, რომლის პრეზენტაციაც 19 მაისის ღონისძიების ფარგლებში მოეწყო.", "მოჭიდავეების დასაშოშმინებლად გუშინ ღამით რუსთაველის გამზირზე ასეულობით <b>საპატრულო მანქანა</b> იყო მობილიზებული.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("61", "ბიოლოგიური საათი", "", "", "ბიოლოგიური", "A", "", "საათი", "S", "PC", "", "ეს არის ადამიანის შინაგანი <b>ბიოლოგიური საათი</b>.", "<b>ბიოლოგიური საათი</b> არეული მაქვს. ", "ყოველ შემთხვევაში, ჩვენი <b>ბიოლოგიური საათი</b> ჯერ მძიმე სამუშაო დღის დასრულებასაც ვერ გრძნობს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("62", "სროლის ხაზი", "", "", "სროლის", "N", "", "ხაზი", "S", "PC", "", "სროლის დროს არ გადაკვეთოთ <b>სროლის ხაზი</b> და არ მიატოვოთ სასროლი პოზიცია.", "ძირითად დისტანციასთან ერთად უზრუნველყოფილი უნდა იყოს მი<b>სროლის ხაზი</b>, სადაც მონაწილეებს შეჯიბრებამდე შეეძლებათ მისროლა.", "საშუალო სკოლაში, NCAA, WNBA და NBA დონეზე, თავისუფალი <b>სროლის ხაზი</b> ამ წერტილიდან 15 მეტრია.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("63", "კვების ბაზარი", "", "", "კვების", "N", "", "ბაზარი", "S", "C", "", "სწრაფი <b>კვების ბაზარი</b>.", "მისივე სიტყვებით, ევროპაში სწრაფი <b>კვების ბაზარი</b> უფრო მაღალი ტემპებით ვითარდება, ვიდრე ჩრდილოეთ ამერიკაში.", "2004 წელს კომპანია BSN-მა, რომელმაც გამოუშვა პირველი N.O.-Xplode, მთლიანად შეცვალა სპორტული <b>კვების ბაზარი</b> და ამაზე არ შეჩერებულა და გამოუშვა NO-Xplode.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("64", "დასაქმების ბაზარი", "", "", "დასაქმების", "N", "", "ბაზარი", "S", "C", "", "ჭარბობს მოთხოვნა კვალიფიციურ სპეციალისტებზე, მაშინ როცა <b>დასაქმების ბაზარი</b> გაჯერებულია უმაღლესი განათლების მქონე კადრებით.", "შესაძლებლობები უზარმაზარია, <b>დასაქმების ბაზარი</b> – ერთობ ფართო.", "როგორ შეიცვალა, ბოლო წლებში, <b>დასაქმების ბაზარი</b>? ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("65", "შავი ყუთი", "", "", "შავი", "A", "", "ყუთი", "S", "PC", "", "<b>შავი ყუთი</b> ციდან იყრება აგურისფერი ფერფლი, მიწა სველია. ", "ეს იყო პატარა მრგვალი ან (გაუმჯობესებული) ოთხკუთხა <b>შავი ყუთი</b>, რომლის შიგნით სპილენძის წვრილი მავთულის ხვეულა იყო...", "ბექამ მშვიდობით მოიპოვა <b>შავი ყუთი</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("66", "ქვეითი ჯარისკაცი", "", "", "ქვეითი", "N", "", "ჯარისკაცი", "S", "PC", "", "სამხედრო შენაერთის შემადგენლობაში შედიან კოჯრის სპეციალური ბატალიონის 34 <b>ქვეითი ჯარისკაცი</b>, 20-კაციანი სამედიცინო შენაერთი და 15-კაციანი საინჟინრო შენაერთი.", "მახსოვს 1812 წლის ომი: ბოროდინოს ველზე მე ციმბირის „ველური” ჯარის <b>ქვეითი ჯარისკაცი</b> ვიყავი.", "პენტაგონის მონაცემებით, ოპერაციაში მონაწილეობას მიიღებენ თითქმის 4 ათასი საზღვაო <b>ქვეითი ჯარისკაცი</b>, აგრეთვე დაახლოებით 650 ავღანელი ჯარისკაცი და პოლიციელი.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("67", "ნაკიანი წელიწადი", "", "", "ნაკიანი", "A", "", "წელიწადი", "S", "PC", "", "და ეს იყო <b>ნაკიანი წელიწადი</b>, ანუ 366-დღიანი.", "ოცდამეერთე საუკუნის პირველი, <b>ნაკიანი წელიწადი</b> გვიჩვენებს, აქვს თუ არა ნამდვილად ეს სურვილი საქართველოს ხელისუფლებას.", "ორიათასის <b>ნაკიანი წელიწადი</b> გვიჩვენებს არჩევნების შემდგომი პერიოდის ხელისუფლების ერთგვარ ანამნეზს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("68", "ძველმანების ბაზრობა", "", "", "ძველმანების", "N", "", "ბაზრობა", "S", "NC", "", "1994 წელს სტიქიურად გაჩენილი <b>ძველმანების ბაზრობა</b> დღეს ქალაქის ერთ-ერთი ყველაზე კოლორიტული ადგილია.", "<b>ძველმანების ბაზრობა</b> მისთვის საარსებო წყაროა ….", "წინამძღვრიშვილის ქუჩაზე ე.წ. <b>ძველმანების ბაზრობა</b> იწვის", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("69", "წამყვანი კანდიდატი", "", "", "წამყვანი", "A", "", "კანდიდატი", "S", "PC", "", "წინასაარჩევნო პროცესის საწყის ეტაპზე თითქმის ყველა <b>წამყვანი კანდიდატი</b> აქტიურად წარმოაჩენდა საკუთარ რელიგიურობას.", "ითვლიან იმასაც კი, რამდენ ბავშვსა თუ მოზრდილს კოცნის წინასაარჩევნო პერიოდში ესა თუ ის <b>წამყვანი კანდიდატი</b>.", "ყოფილი უმცროსი სენატორი ილინოისიდან და 2008 წლის საპრეზიდენტო არჩევნებში <b>წამყვანი კანდიდატი</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("70", "სასიყვარულო სიმღერა", "", "", "სასიყვარულო", "A", "", "სიმღერა", "S", "PC", "", "მაგრამ რადგან ლექსს <b>სასიყვარულო სიმღერა</b> ქვია..", "ეს <b>სასიყვარულო სიმღერა</b> ბერას ფანებს მისი ინტიმური სამყაროს თანამოზიარეს ხდის.", "რომ ახლა მისი დანახვა შეიძლება მხოლოდ სურათში „<b>სასიყვარულო სიმღერა</b> ბობი ლონგისათვის”, სადაც მე ჯონ ტრავოლტასთან ერთად ვთამაშობდი.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("71", "გამოუვალი მდგომარეობა", "", "", "გამოუვალი", "A", "", "მდგომარეობა", "S", "PC", "", "უფრო სწორად, არ არსებობს <b>გამოუვალი მდგომარეობა</b>.", "დიდ ბოდიშს ვიხდით, მაგრამ <b>გამოუვალი მდგომარეობა</b> გვაქვს და უნდა გვიშველოთ.", "შენ არ ამბობდი, <b>გამოუვალი მდგომარეობა</b> არ არსებობსო? – მიაჩერდა თაზო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("72", "დაგეგმილი მოქმედება", "", "", "დაგეგმილი", "A", "", "მოქმედება", "S", "PC", "", "ორგანიზატორების ინფორმაციით, 27-28 მარტს <b>დაგეგმილი მოქმედება</b>", "დაგეგმვის თვალსაზრისით საქმის კეთების სამი მიდგომა შეიძლება გამოიყოს: იმპროვიზაცია, <b>დაგეგმილი მოქმედება</b> და დაგეგმილი იმპროვიზაცია.", "„ეს იყო <b>დაგეგმილი მოქმედება</b> ღირსების შესალახად“ – იურისტი სააკაშვილის გლდანში გადაყვანაზე.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("73", "ტვინის რუხი ნივთიერება", "", "", "ტვინის", "N", "", "რუხი", "S", "NC", "", "ზურგის <b>ტვინის რუხი ნივთიერება</b> შექმნილია ნერვული უკრედებით, ნერვული ბოჭკოებითა და ნეიროგლიით. ", "როგორც გაირკვა, ქალების თავის <b>ტვინის რუხი ნივთიერება</b> თავიდანვე რამდენადმე მცირე მოცულობისაა, თუმცა, გაცილებით მკვრივი, ვიდრე მამაკაცებისა. ", "<b>ტვინის რუხი ნივთიერება</b>: სტრუქტურა და ფუნქციები", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("74", "თავშეკავებული პოზიცია", "", "", "თავშეკავებული", "A", "", "პოზიცია", "S", "NC", "", "ამასთან საქართველოს მხარე ცდილობს შეინარჩუნოს მაქსიმალურად <b>თავშეკავებული პოზიცია</b>, – აცხადებს საგარეო უწყება.", "ჩრდილოეთი კორეის საკითხში თეთრი სახლის ადმინისტრაციას აშკარად უფრო <b>თავშეკავებული პოზიცია</b> უკავია.", "გაცილებით <b>თავშეკავებული პოზიცია</b> ჰქონდა მაშინ საქართველოს მართლმადიდებელ ეკლესიას.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("75", "ოქროს მაღარო", "", "", "ოქროს", "N", "", "მაღარო", "S", "PC", "", "თქვენ თქვით, რომ ეს არის უძველესი <b>ოქროს მაღარო</b>.", "ეს არ დასტურდება, რომ არის უძველესი <b>ოქროს მაღარო</b>.", "იყო აქ მცდელობები, ეთქვათ, რომ ეს არ არის <b>ოქროს მაღარო</b>, რომ ეს არის სპილენძის ან მარილის მაღარო…", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("76", "სისხლის აბაზანა", "", "", "სისხლის", "N", "", "აბაზანა", "S", "PC", "", "სისხლიანი ბლინები, <b>სისხლის აბაზანა</b> და სისხლის გამოყენების სხვა უჩვეულო და შემზარავი მეთოდები", "ბუნებრივია, ამან გამოიწვია <b>სისხლის აბაზანა</b>, რამაც დასრულდა მეომრებისა და რეგიონის მკვიდრთა სიცოცხლე, რომლებიც მონაწილეობდნენ.", "თმა მთლიანად სისხლიან ქონდა, ტანსაცმელიც, გეგონებათ <b>სისხლის აბაზანა</b> მიიღო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("77", "მარკეტინგის კონსულტანტი", "", "", "მარკეტინგის", "N", "", "კონსულტანტი", "S", "PC", "", "თავად ბიზნესმენი გახლავთ – თამაშებისა და გართობის სფეროს მენეჯმენტისა და <b>მარკეტინგის კონსულტანტი</b>.", "მაგრამ ბიოლოგიური მეურნეობის „ელკანას” ასოციაციის <b>მარკეტინგის კონსულტანტი</b> ირაკლი ჯავახიშვილი ამბობს, რომ, მიუხედავად რისკებისა...", "როგორ დავიქირაოთ <b>მარკეტინგის კონსულტანტი</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("78", "პოლოს მაისური", "", "", "პოლოს", "N", "", "მაისური", "S", "NC", "", "<b>პოლოს მაისური</b> საფრანგეთიდან. 100% ბამბა.", "<b>პოლოს მაისური</b> ოქროსფერი ბორჯღალით.", "დახვეწილი <b>პოლოს მაისური</b>, გახადეთ იგი განსხვავებული.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("79", "ცისფერი სისხლი", "", "", "ცისფერი", "A", "", "სისხლი", "S", "PC", "", "ავთო, <b>ცისფერი სისხლი</b> აქვს! – გაიკრიჭა არამიკა.", "ზურაბ ნაყოფიას გენებში ჩქეფდა, როგორც აფაქიძეების, ისე შერვაშიძეების <b>ცისფერი სისხლი</b>.", "1983 წელს საბჭოთა კავშირში გამოსცადეს „<b>ცისფერი სისხლი</b>”.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("80", "სამედიცინო პროცედურა", "", "", "სამედიცინო", "A", "", "პროცედურა", "S", "PC", "", "...ამირან გამყრელიძე ამბობს, რომ საქართველოში, იშვიათი გამონაკლისის გარდა, ყველა სახის <b>სამედიცინო პროცედურა</b> კეთდება, თუმცა გააჩნია ხარისხს. ", "მას ჩაუტარდა სხვადასხვა <b>სამედიცინო პროცედურა</b>, რის შემდეგაც სახლში, ნუცუბიძის ქუჩაზე გადაიყვანეს. ", "ეს <b>სამედიცინო პროცედურა</b> სტაციონარში ან პოლიკლინიკაში უნდა გაკეთდეს. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("81", "საჯარო სამსახური", "", "", "საჯარო", "A", "", "სამსახური", "S", "C", "", "პრეზიდენტის განცხადებით, <b>საჯარო სამსახური</b> ნარკოტიკებისგან საბოლოოდ უნდა გაიწმინოს.", "<b>საჯარო სამსახური</b> აუცილებელია, მისი მეშვეობითაა კეთილდღეობა ჩვენს საზოგადოებაში.", "ამიხსნეს, რომ ეს თანამდებობა <b>საჯარო სამსახური</b> არაა და ჩემს პირობას არ ეწინააღმდეგება. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("82", "ზღვის გოჭი", "", "", "ზღვის", "N", "", "გოჭი", "S", "NC", "", "ალექსანდრეს საყვარელი <b>ზღვის გოჭი</b> გამახსენდა, მის შემხედვარეს. დავუდებთ „სან-სანიჩს” პატიოსნად საჭმელს თეფშზე.", "სხვა ცხოველებიც გყავთ? – ამჟამად არ მყავს, თუმცა მყავდა კატა ჯიმი და <b>ზღვის გოჭი</b> კლეოპატრა.", "ხოლო თქვენს შემთხვევაში კი, ჯერ გასარკვევია ნაყოფი ზაზუნაა, ვირთხა, ვირთაგვა, <b>ზღვის გოჭი</b> თუ სხვა რომელიმე ამის მსგავსი ცხოველი და მხოლოდ ამის შემდეგ შეგვიძლია მის სქესს მივხედოთ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("83", "ღამის ცვლა", "", "", "ღამის", "N", "", "ცვლა", "S", "NC", "", "<b>ღამის ცვლა</b> უფრო მიყვარს.", "ჰოდა, მე და ჩემმა მეგობარმა რევაზ მაღლაკელიძემ <b>ღამის ცვლა</b> მოვამთავრეთ თუ არა, მეტალურგიული ქარხნიდანვე პირდაპირ იქ გავწიეთ.", "ავტობუსს ცეცხლი გაუჩნდა, როდესაც ქარხანაში მუშების <b>ღამის ცვლა</b> გადაჰყავდა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("84", "მუსიკალური ფესტივალი", "", "", "მუსიკალური", "A", "", "ფესტივალი", "S", "PC", "", "იქ ხშირად იმართება კინო და <b>მუსიკალური ფესტივალი</b>, ყოველწლიურად სწორედ ამ ქალაქში ირჩევენ „მის ამერიკას” …", "ანაკლიაში ცხრადღიანი <b>მუსიკალური ფესტივალი</b> 30 ივლისს დაიწყება და 7 აგვისტომდე გასტანს.", "<b>მუსიკალური ფესტივალი</b> 14 აგვისტოს დასრულდება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("85", "უნაყოფო საქმიანობა", "", "", "უნაყოფო", "A", "", "საქმიანობა", "S", "NC", "", "ბოლოს მიხვდა, რომ ეს <b>უნაყოფო საქმიანობა</b> იყო, და წამოდგა.", "მისი ქმედებები შემთხვევითია, <b>უნაყოფო საქმიანობა</b> და პეჩორინი უკმაყოფილოა", "...რომ გააგრძელონ <b>უნაყოფო საქმიანობა</b> ამ ადგილებში, რადგან ქლორის სუნი იზიდავს მათ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("86", "ტვინების გადინება", "", "", "ტვინების", "N", "", "გადინება", "S", "C", "", "დღეს საქართველოდან „<b>ტვინების გადინება</b>” ძირითადად ტექნიკური მეცნიერებებიდან ხდება.", "ამას ჰქვია <b>ტვინების გადინება</b> და ერის გამოტვინება. ", "„<b>ტვინების გადინება</b>” ძირითადად ამერიკაში ხდება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("87", "მუსიკალური ჟურნალისტი", "", "", "მუსიკალური", "A", "", "ჟურნალისტი", "S", "NC", "", "6 მაისს დიდი ინტერვიუ გამოაქვეყნა ჯანსუღ კახიძესთან, რომლის ავტორიც, ცნობილი ფრანგი <b>მუსიკალური ჟურნალისტი</b> ერიკ დაანი...", "თანამედროვე <b>მუსიკალური ჟურნალისტი</b> ინოვაციური, სწრაფი და გაბედულია. აღნიშნული კურსი განკუთვნილია იმ ადამიანებისთვის ვინც დაინტერესებულები არიან ხმოვანებით, ციფრული სამყაროს გამოწვევებით და მუსიკაზე წერით.", "<b>მუსიკალური ჟურნალისტი</b> წერს მუსიკალურ სიახლეებზე, იღებს ინტერვიუს არტისტებისგან, მიმოიხილავს ალბომებსა და ღონისძებებს და ხშირად წერს მუსიკალურ კრიტიკას.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("88", "მოკლე გზა", "", "", "მოკლე", "A", "", "გზა", "S", "PC", "", "ხელოვანებმა აირჩიეს უფრო <b>მოკლე გზა</b>.", "მან ასევე განაცხადა, რომ საქართველოს „უფრო <b>მოკლე გზა</b> აქვს ევროპისკენ რუსეთის გავლით”.", "ეს იქნება ყველაზე <b>მოკლე გზა</b> შუა აზიიდან და ირანიდან ევროპის მიმართულებით ტვირთების გადასაზიდად.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("89", "ჯანმრთელობის შემოწმება", "", "", "ჯანმრთელობის", "N", "", "შემოწმება", "S", "PC", "", "აქვე დადგა მეორე საკითხი – პედაგოგების <b>ჯანმრთელობის შემოწმება</b>, რომლის დაფინანსება ქალაქის ბიუჯეტმა აიღო საკუთარ თავზე.", "რაც შეეხება მათ ფიზიკურ ჯანმრთელობას, 36-ივე ოლიმპიადაზე წამსვლელმა სპორტსმენმა <b>ჯანმრთელობის შემოწმება</b> პროფესორ ეგნატე ფიფიას სახელობის კვლევით ცენტრში გაიარა.", "მან საქართველოს მთავრობას რამდენჯერმე დაავალა ავადმყოფ კუსა დოლიძის <b>ჯანმრთელობის შემოწმება</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("90", "მზარდი ბაზარი", "", "", "მზარდი", "A", "", "ბაზარი", "S", "PC", "", "ამიტომაცაა ინდონეზია ერთ-ერთი <b>მზარდი ბაზარი</b>, რომელზეც, ჩემი ინიციატივით, ვაპირებთ, გავაორმაგოთ ამერიკის ექსპორტი.", "სწრაფად <b>მზარდი ბაზარი</b>", "ჩვენ გვაქვს <b>მზარდი ბაზარი</b>, მოსახლეობის აქტივობა დაზღვევის მიმართ მატულობს. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("91", "საბაგირო მანქანა", "", "", "საბაგირო", "A", "", "მანქანა", "S", "NC", "", "<b>საბაგირო მანქანა</b> თბილისში / საჰაერო ტრამვაი თბილისში", "ახალი <b>საბაგირო მანქანა</b> კილიმანჯაროს მთაზე? ტანზანიის ტურიზმი ამბობს არა!", "ჩვენი კომპანიის მიერ წარმოებული <b>საბაგირო მანქანა</b> აღჭურვილია ინდუქციური კარით.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("92", "კარგი ცხოვრება", "", "", "კარგი", "A", "", "ცხოვრება", "S", "NC", "", "ეშმაკი ხარ, ფარნაოზ, ეშმაკი, შენც გყვარებია <b>კარგი ცხოვრება</b>.", "დიდი მზითვი უნდა გამოაყოლონ, ხო იცი! <b>კარგი ცხოვრება</b> მიყვარს! – აზარტში შესულიყო უჩა.", "<b>კარგი ცხოვრება</b> გინდათ, მაგრამ ეს <b>კარგი ცხოვრება</b> თუ რუსეთის დასამარების ხარჯზე არ მოხდა, უარს აცხადებთ მასზე.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("93", "სამშვიდობო კონფერენცია", "", "", "სამშვიდობო", "A", "", "კონფერენცია", "S", "PC", "", "თუმცა, არაბი ლიდერების ჩასვლა კონფერენციაზე არ არის იმის გარანტია, რომ <b>სამშვიდობო კონფერენცია</b> შედეგიანი იქნება.", "თუ საერთაშორისო <b>სამშვიდობო კონფერენცია</b> გაიმართება რუსეთში, ეს თვითონ რუსეთისათვისაც სასარგებლო იქნება...", "<b>სამშვიდობო კონფერენცია</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("94", "კვლევითი პროექტი", "", "", "კვლევითი", "A", "", "პროექტი", "S", "PC", "", "საქართველოში ეს იყო ერთ-ერთი პირველი ორგანიზებული <b>კვლევითი პროექტი</b>, რომელმაც უშუალო მეთოდოლოგიად ზეპირი ისტორიის კვლევა აირჩია.", "ცენტრმა დღემდე 1000-ზე მეტი სამეცნიერო <b>კვლევითი პროექტი</b> დააფინანსა.", "ერთ-ერთია <b>კვლევითი პროექტი</b>, რომელსაც რუსეთის სახელმწიფო საზღვაო არქივთან ერთად ვახორციელებთ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("95", "შიდა წრე", "", "", "შიდა", "A", "", "წრე", "S", "PC", "", "<b>შიდა წრე</b> შეიძლება იყოს დახურული ან ღია.", "როგორ შევქმნათ ჩვენი <b>შიდა წრე</b>?", "“ივანიშვილს ყველაზე უდევს სქელი დოსიე, <b>შიდა წრე</b> საბელით უჭირავს… რა თქმა უნდა, დათო ტურაშვილი ბევრად უფრო საშიშია ამ ტიპის რეჟიმისთვის“ – გია ხუხაშვილი", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("96", "ქვედა სართული", "", "", "ქვედა", "A", "", "სართული", "S", "PC", "", "დამიხაზე <b>ქვედა სართული</b>, – უთხრა კადრუსმა.", "ეკლესიის <b>ქვედა სართული</b> სვეტების რიგს ქმნის და კლასიცისტური დეკორითაა გაფორმებული.", "ახლა <b>ქვედა სართული</b> გამოჩნდა ნაღვლიანი და უსიცოცხლო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("97", "შიდა პროდუქტი", "", "", "შიდა", "A", "", "პროდუქტი", "S", "PC", "", "2006 წლისათვის მთლიანი <b>შიდა პროდუქტი</b> 7.5 პროცენტით გაიზრდება და 12.9 მლრდ ლარს გადააჭარბებს.", "მომავალ წელს რეალური მთლიანი <b>შიდა პროდუქტი</b> (მშპ) 2 %-ით გაიზრდება და 19 მლრდ ლარს გადააჭარბებს.", "2011 წლის ბოლო სამ თვეში მთლიანი <b>შიდა პროდუქტი</b> (მშპ) 8.8 %-ით გაიზარდა წინა წლის შესაბამის პერიოდთან შედარებით.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("98", "კალენდარული თვე", "", "", "კალენდარული", "A", "", "თვე", "S", "PC", "", "მოგების დაბეგვრის საანგარიშო პერიოდი კი იქნება <b>კალენდარული თვე</b>, ამჟამად არსებული კალენდარული წლის ნაცვლად.", "სადისციპლინო-ტექნიკური კომიტეტის გადაწყვეტილების თანახმად, დოლიძემ ერთი <b>კალენდარული თვე</b> გამოტოვა ეროვნულ ჩემპიონატში.", "ემოციების შადრევნებამდე ასკდებიან ჩვენს გაშიშვლებულ მხურვალებას <b>კალენდარული თვე</b> და დღეები. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("99", "სამშვიდობო საუბარი", "", "", "სამშვიდობო", "A", "", "საუბარი", "S", "PC", "", "ეს არის პრობლემა მაგრამ აქვე მინდა ვთქვა, რომ ასევე ვერ ვხედავთ საერთაშორისო თანამეგობრობის მხრიდან საკმარის ძალისხმევას, რომ განახორციელონ სწორი ზომები, რომ წარიმართოს <b>სამშვიდობო საუბარი</b>, — განაცხადა პრემიერმა.", "<b>სამშვიდობო საუბარი</b> ყოველთვის რთულია, ყოველთვის რთულია", "", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("100", "სინდისის ქენჯნა", "", "", "სინდისის", "N", "", "ქენჯნა", "S", "PC", "", "შინისკენ წამოსულს <b>სინდისის ქენჯნა</b> შემომიჩნდა.", "მომეტევოს – <b>სინდისის ქენჯნა</b> მეყოს სასჯელად.", "ბრალმდებელმა <b>სინდისის ქენჯნა</b> იგრძნო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("101", "კლდის ძირი", "", "", "კლდის", "N", "", "ძირი", "S", "NC", "", "იმას საქონელი აღარ აჯავრებდა, არ გადურჩა გაუჩხრეკელი ღრანტობი, არც ხის ძირი, არც <b>კლდის ძირი</b>.", "<b>კლდის ძირი</b> გამოფიტულია და ისეთ დაქანებას ქმნის, რომელიც კლდეს რთულსა და მიუდგომელს ხდის.", "იოთამი არა სცხრებოდა, გაფაციცებით დაეძებდა შვილებს, იმას საქონელი აღარ აჯავრებდა, არ გადურჩა გაუჩხრეკელი ღრანტობი, არც ხის ძირი, არც კლდის ძირი.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("102", "გიჟების თავშესაფარი", "", "", "გიჟების", "N", "", "თავშესაფარი", "S", "NC", "", "კიევის დიპლომატიური სკოლა არ იყო <b>გიჟების თავშესაფარი</b>.", "სადაც მოხერხებულად იყო განთავსებული ქალაქის სასაკლაო, ასევე <b>გიჟების თავშესაფარი</b>", "გრაფის გარდაცვალების შემდეგ ციხე გამოიყენებოდა როგორც მონასტერი, ციხე, ბავშვთა სახლი და <b>გიჟების თავშესაფარი</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("103", "სამოქალაქო ქორწინება", "", "", "სამოქალაქო", "A", "", "ქორწინება", "S", "PC", "", "და მაინც, რატომ სჭირდება ლეჯიბიტ თემს <b>სამოქალაქო ქორწინება</b>? ", "ის, რომ 2002 წელს მან <b>სამოქალაქო ქორწინება</b> გააფორმა სხვა ქალთან, ისლანდიელებს აშკარად არ აინტერესებდათ.", "მანამადე <b>სამოქალაქო ქორწინება</b> გაუფორმებიათ, მაგრამ მერე მაინც ყველა წყვილი ჩვენთან მოდის.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("104", "სარაკეტო მეცნიერება", "", "", "სარაკეტო", "A", "", "მეცნიერება", "S", "NC", "", "ეს არ არის <b>სარაკეტო მეცნიერება</b> - თუ საქართველოს სურს გახდეს ევროპული ქვეყნების ჯგუფის წევრი, ამისთვის საჭიროა თავისუფალი ხალხი, რომელსაც აქვს წვდომა ისეთ თავისუფლებებზე, როგორიცაა პრესის თავისუფლება, შეკრების თავისუფლება, სიტყვის თავისუფლება,- ასე უპასუხა რესპუბლიკელმა სენატორმა ჯიმ რიშმა „ამერიკის ხმის“ კითხვას საქართველოს ევროკავშირში გაწევრიანების სურვილთან დაკავშირებით.", "იმის გამო, რომ <b>სარაკეტო მეცნიერება</b> არა მხოლოდ ძნელია, ის ასევე ლამაზია იმიტომ, რომ ჩვენ გვიყვარს SpaceX და მათი საოცარი ფოტოები რადგან მომავალი ისევ საინტერესოა.", "ეს შეიძლება სხვებისთვის <b>სარაკეტო მეცნიერება</b> იყოს, მაგრამ ჩვენთვის ოფისში კიდევ ერთი დღეა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("105", "სასიკვდილო განაჩენი", "", "", "სასიკვდილო", "A", "", "განაჩენი", "S", "NC", "", "ამ დროს <b>სასიკვდილო განაჩენი</b> სისრულეში მოჰყავთ და სელმას ლამაზი სიმღერა უეცრად წყდება.", "ანატოლი: <b>სასიკვდილო განაჩენი</b> გამოგაქვს ჩემთვის. ", "გასულ კვირაში სომხეთის პარლამენტმა დაამტკიცა სისხლის სამართლის ახალი კოდექსი, რომელშიც <b>სასიკვდილო განაჩენი</b> სამუდამო პატიმრობით არის შეცვლილი.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("106", "სადაზღვევო კომპანია", "", "", "სადაზღვევო", "A", "", "კომპანია", "S", "PC", "", "რეფორმამდე საქართველოს მოქალაქეებს უფლება არ ჰქონდათ აერჩიათ მათთვის სასურველი <b>სადაზღვევო კომპანია</b>.", "დავით გამყრელიძე <b>სადაზღვევო კომპანია</b> „ალდაგის” დამფუძნებელია.", "<b>სადაზღვევო კომპანია</b> იმედი-ელ-მა (იმედი-L) წელს ზარალი უკვე ორ მძღოლს აუნაზღაურა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("107", "კაკაოს კარაქი", "", "", "კაკაოს", "N", "", "კარაქი", "S", "PC", "", "<b>კაკაოს კარაქი</b> მიიღება შოკოლადის ხის მარცვლებისგან.", "<b>კაკაოს კარაქი</b> - იდეალური საშუალება ულამაზესი რუჯისთვის!", "<b>კაკაოს კარაქი</b> სახის გაახალგაზრდავებისთვის.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("108", "მისაბაძი ადამიანი", "", "", "მისაბაძი", "A", "", "ადამიანი", "S", "NC", "", "ვინ არის შენთვის <b>მისაბაძი ადამიანი</b>? ", "არაჩვეულებრივი ადამიანი იყავი: კარგი დედა, ბებია, მასწავლებელი, მეგობარი, ყველასთვის <b>მისაბაძი ადამიანი</b>.", "თქვენ მათთვის საამაყო და <b>მისაბაძი ადამიანი</b>, კერპი ხართ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("109", "მთავარი მასწავლებელი", "", "", "მთავარი", "A", "", "მასწავლებელი", "S", "NC", "", "დედა ფუძეა ერის, ვინაიდან ის არის ყველა ჩვენთაგანის პირველი და <b>მთავარი მასწავლებელი</b> სიწმინდის, სათნოების, სიყვარულის, ეროვნული სულისკვეთების და სულიერი სილამაზის.", "იან გ. უილიამსი (ბირმინგჰემის სასწავლო ფაკულტეტის სასწავლო ნაწილის წევრი, <b>მთავარი მასწავლებელი</b>): სინათლის სახლები ადამიანის სულიერ ამაღლებულობას მოიცავს.", "ჩემი <b>მთავარი მასწავლებელი</b> ყველა ჩემი მოსწავლეა…", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("110", "პიკის საათი", "", "", "პიკის", "N", "", "საათი", "S", "PC", "", "ახლა <b>პიკის საათი</b> იწყება.", "აბანოს ხალათი ღამის პერანგზე შემოიცვა და ტრანზისტორი ჩართო – „<b>პიკის საათი</b>” იწყებოდა.", "რომ გამოხვიდოდი საღამოს, <b>პიკის საათი</b> ხომ იყო? ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("111", "სადაზღვევო პოლისი", "", "", "სადაზღვევო", "A", "", "პოლისი", "S", "PC", "", "მართალია, ჩემს დიასახლისს, <b>სადაზღვევო პოლისი</b> ჰქონდა, მაგრამ მკურნალობის საფასურის რაღაც ნაწილი უნდა გადაეხადა.", "მიზნობრივი ვაუჩერით მოსახლეობას მისთვის სასურველი <b>სადაზღვევო პოლისი</b> უნდა შეეძინა.", "უნდა აღინიშნოს, რომ მსხვერპლთა უმეტესობას <b>სადაზღვევო პოლისი</b> საერთოდ არ ჰქონდა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("112", "ჯანმრთელობის დაზღვევა", "", "", "ჯანმრთელობის", "N", "", "დაზღვევა", "S", "PC", "", "აღმოჩნდა, რომ ყველაზე ძვირი სადაზღვევო პროდუქტია <b>ჯანმრთელობის დაზღვევა</b>. ", "ამ ეტაპზე მათ არა აქვთ <b>ჯანმრთელობის დაზღვევა</b> და არ სარგებლობენ სოციალური შეღავათებით.", "გვაქვს მხოლოდ ომის ვეტერანის სტატუსი, მაგრამ არც პენსია გვაქვს და არც <b>ჯანმრთელობის დაზღვევა</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("113", "კომპიუტერული ექსპერტი", "", "", "კომპიუტერული", "A", "", "ექსპერტი", "S", "PC", "", "გასათვალისწინებელია ისიც, რომ <b>კომპიუტერული ექსპერტი</b> მოწმის მიერ მოწოდებული ანალიზით გამოიყენება არა მხოლოდ სასამართლო პროცესზე სასამართლო პროცესის დევნის ან დაცვის საქმეში, არამედ შეიძლება გამოყენებულ იქნას კომპიუტერული დანაშაულის შემდგომი ინსტანციების გამოვლენაში და თავიდან აცილების მიზნით. ", "დაინსტალირების შემდეგ დაწყების და ამ სიჩქარით-up კომპიუტერული პროგრამა, იგი ავტომატურად შეამოწმოთ თქვენი კომპიუტერის ინფორმაცია როგორც ქვემოთ და არიან დეტალური ანგარიში თქვენთვის. თქვენ არ უნდა იყოს <b>კომპიუტერული ექსპერტი</b>.", "დროთა განმავლობაში, სიხშირე, რომლის დროსაც ადამიანები (ზოგადად, ახალგაზრდები) ატარებენ კომპიუტერის წინ, იზრდება, რაც მრავალ რეაქციას იწვევს, რადგან ჩვენ შეგვიძლია დავაკვირდეთ, თუ როგორ ხალხს შეუძლია გახდეს <b>კომპიუტერული ექსპერტი</b> საათების დიდი რაოდენობის გამო ისინი გადიან მასში რაიმე საქმიანობას.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("114", "რადიოაქტიური მასალა", "", "", "რადიოაქტიური", "A", "", "მასალა", "S", "PC", "", "...1992-1993 წლების ქართულ-აფხაზური შეიარაღებულ კონფლიქტამდე ინსტიტუტის საწყობში 244 სახეობის <b>რადიოაქტიური მასალა</b> და 655 გრამი გამდიდრებული ურანი ინახებოდა.", "აშშ დეტექტორს გვჩუქნის სოფო ჩიხლაძე საქართველოს საზღვრებიდან ბირთვული და სხვა <b>რადიოაქტიური მასალა</b>, კონტრაბანდა რომ არ შემოვიდეს...", "...ჯობია ხელუხლებელი დარჩეს ქართული და აფხაზური მხარეების მიერ 1993 წელს აღრიცხული ყველა <b>რადიოაქტიური მასალა</b> და ნარჩენები...", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("115", "წმინდა ძროხა", "", "", "წმინდა", "A", "", "ძროხა", "S", "NC", "", "...სრული ატროფიის გამო ეტლიდან ვერ დგებოდა, პირად თვითმფრინავში გადაიყვანეს, რომელსაც „<b>წმინდა ძროხა</b>” ერქვა. ", "მედიას მიუთითეს, რომ ის „<b>წმინდა ძროხა</b>” არ არის, რომლის კრიტიკაც დაუშვებელია.", "„<b>წმინდა ძროხა</b>“ მოგვითხრობს ადამიანზე, რომელიც ცდილობს, დაიცვას ბალანსი  ტრადიციასა და სიახლეებს შორის.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("116", "საკონტაქტო ლინზა", "", "", "საკონტაქტო", "A", "", "ლინზა", "S", "PC", "", "ხოლო იქ, კურსებზე, ერთ მშვენიერ დღეს ერთ-ერთ მსაჯს <b>საკონტაქტო ლინზა</b> გაუფუჭდა და მოედანზე მის მაგივრად გასვლა მთხოვა, რისთვისაც დღემდე ვემადლიერები.", "შეამოწმეთ თქვენი <b>საკონტაქტო ლინზა</b>", "თუ ეს მოსახერხებელი და მარტივია, ამოიღეთ <b>საკონტაქტო ლინზა</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("117", "საძიებო სისტემა", "", "", "საძიებო", "A", "", "სისტემა", "S", "PC", "", "აქ პირველი პრიზი ქართულენოვან ვებ კატალოგს – <b>საძიებო სისტემა</b> „ჯეოლინკს” ერგო წილად.", "სასურველი რუბრიკის, კონკრეტული ტექსტისა და სიმღერის მიწვდომას აადვილებს მარტივი და მკაფიო <b>საძიებო სისტემა</b>. ", "მეორე <b>საძიებო სისტემა</b> Yahoo-მ კი ამ ბრძოლაზე უარი თავისი ნებით განაცხადა. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("118", "რკინის საყელო", "", "", "რკინის", "N", "", "საყელო", "S", "NC", "", "...გარდა ცალფეხა ჯენტლმენისა, რომელმაც შენიშნა, რომ ურიგო არ იქნებოდა, გაეკეთებინათ ჩემთვის <b>რკინის საყელო</b> და თავლაში დავები.", "ამ ავაზაკმა მოატანინა ბორკილები და <b>რკინის საყელო</b> : ამან, მართალი უნდა ვთქვა, ცოტათი შემაშინა: მქონდა საქმე ჯარის ხალხთან...", "როცა მთავარი მოინდომებს ვისიმე დაჭერას, ბრძანებს, რომ მას ყელზე წამოაცვან <b>რკინის საყელო</b> დიდის და მძიმე ჯაჭვითო და ამ სახით ჩააბარეთ დარაჯსო", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("119", "საპროცენტო განაკვეთი", "", "", "საპროცენტო", "A", "", "განაკვეთი", "S", "NC", "", "ხელშეკრულების მიხედვით ყოველწიული <b>საპროცენტო განაკვეთი</b> 4-დან 3 %-მდე მცირდება. ", "ორივე კრედიტი, რომელთა წლიური <b>საპროცენტო განაკვეთი</b> 3 %-ს შეადგენს, საქართველოში გზების რეაბილიტაციას მოხმარდება.", "ამ კატეგორიის სესხის <b>საპროცენტო განაკვეთი</b> 4 % იქნება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("120", "მუშათა კავშირი", "", "", "მუშათა", "N", "", "კავშირი", "S", "NC", "", "ერდოანი: ვაშინგტონმა ან თურქეთი უნდა აირჩიოს, ან – ქურთების <b>მუშათა კავშირი</b>...", "<b>მუშათა კავშირი</b>, რომლის წესდება აქვე იბეჭდება.", "იქ მან შექმნა „საჩხერის რკინიგზის ხე-ტყის საექსპლუატაციო <b>მუშათა კავშირი</b>“.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("121", "ვერცხლის ტყვია", "", "", "ვერცხლის", "N", "", "ტყვია", "S", "NC", "", "მაგრამ აქ არ არსებობს ე. წ. „<b>ვერცხლის ტყვია</b>”.", "ბარმენები ირწმუნებიან, რომ <b>ვერცხლის ტყვია</b> შესაძლოა ინგლისში იყოს გამოგონილი.", "„ვაქცინაცია ეს არ არის <b>ვერცხლის ტყვია</b>, ეს მხოლოდ ერთი ინსტრუმენტია,“ - ჯანმოს მთავარი მეცნიერი", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("122", "კრიმინალის დონე", "", "", "კრიმინალის", "N", "", "დონე", "S", "PC", "", "რესპონდენტთა 35 პროცენტის აზრით, 2012 წლის ოქტომბრის შემდეგ <b>კრიმინალის დონე</b> გაიზარდა.", "46 პროცენტი ამბობს, რომ <b>კრიმინალის დონე</b> იგივე დარჩა.", "<b>კრიმინალის დონე</b> ძალიან დაეცა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("123", "სამაშველო ქამარი", "", "", "სამაშველო", "A", "", "ქამარი", "S", "PC", "", "მათ შეაჭრეს მთამსვლელს <b>სამაშველო ქამარი</b> ზედ ახალი ავსტრიული თოკის ნაგლეჯით.", "ჰქონდეს მაშველი ჟილეტი ან <b>სამაშველო ქამარი</b>. ", "<b>სამაშველო ქამარი</b> წელის არეში, წვნიანი ფეხები, კეთილშობილი მუცელი - სუსტი და არასათანადო მეტაბოლიზმის შედეგები.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("124", "იმედების გაცრუება", "", "", "იმედების", "N", "", "გაცრუება", "S", "NC", "", "ის ჩვეულებრივი მხიარული ბავშვი იყო, არაფერს შეეძლო მისი დაღონება, მისი ბავშვური <b>იმედების გაცრუება</b>…", "„მე არ მჩვევია პრეზიდენტის <b>იმედების გაცრუება</b>”, დასძინა ოქრუაშვილმა.", "ამომრჩეველთა 96 პროცენტიდან გარკვეული ნაწილის <b>იმედების გაცრუება</b> მოგიწევს – ეს გარდაუვალია.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("125", "დიდი ეკრანი", "", "", "დიდი", "A", "", "ეკრანი", "S", "NC", "", "შიგნით სკამები და <b>დიდი ეკრანი</b>, უკან პროექტორი და კინოს კაცი – ზერო. ", "დარბაზში კი სიბნელეა და ვერაფერს ხედავს, უცებ, <b>დიდი ეკრანი</b> ნათდება და იქვე სკამზე ჩამოჯდება.", "მათთვის, ვინც დროულად ვერ მივა სპექტაკლზე, ფოიეში <b>დიდი ეკრანი</b> იქნება დამონტაჟებული.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("126", "ვერცხლის კოვზი", "", "", "ვერცხლის", "N", "", "კოვზი", "S", "PC", "", "<b>ვერცხლის კოვზი</b> წკარუნობს ჭიქაში.", "...დასაჭერად მოსულთაგან ერთ-ერთმა თაფლით სავსე ჭიქაში ჩადებული <b>ვერცხლის კოვზი</b> შენიშნა.", "მის კოლექციაშია თიხის ჩიბუხები, წყვილი საყურე, მეზღვაურთა დანები, სექსტანტი, სამი <b>ვერცხლის კოვზი</b>", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("127", "სამაშველო ჟილეტი", "", "", "სამაშველო", "A", "", "ჟილეტი", "S", "PC", "", "ისეთ დეტალებს ეჭიდება, როგორიცაა: <b>სამაშველო ჟილეტი</b>, ჩაფხუტი, თასმიანი ჩექმა, ცხენოსნის შარვალი და სხვა.", "სერენაც მათ შეუერთდა და <b>სამაშველო ჟილეტი</b> ჩაიცვა.", "ბრაზილიის ნაპირებთან ჩამოვარდნილ თვითმფრინავში მან თავისი <b>სამაშველო ჟილეტი</b> ბავშვს დაუთმო და ოკეანის ტალღებს სამარადისოდ შეუერთდა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("128", "დღის ცვლა", "", "", "დღის", "N", "", "ცვლა", "S", "PC", "", "ვაცხადებთ ვაკანსიას ქოლცენტრის კონსულტანტის (<b>დღის ცვლა</b>) პოზიციაზე.", "იფქლი-1 აცხადებს ვაკანსიას მაღაზიის გამყიდველ-კონსულტანტის (<b>დღის ცვლა</b> ღამის ცვლა) ", "<b>დღის ცვლა</b> ხდება დილის 6 საათიდან საღამოს 7 საათამდე, ხოლო ღამის ცვლა ხდება დილის 6 საათიდან საღამოს 7 საათამდე. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("129", "უსამართლო სასამართლო", "", "", "უსამართლო", "A", "", "სასამართლო", "S", "NC", "", "ხელისუფლებასთან, რომელსაც ასეთი სასტიკი ძალისმიერი სტრუქტურები ჰყავს, ასეთი <b>უსამართლო სასამართლო</b> ჰყავს.", "ადამიანის უფლებების დარღვევები, <b>უსამართლო სასამართლო</b> ზნეობრივი არ არის.", "მათ ხელშია პოლიცია, ჯარი, <b>უსამართლო სასამართლო</b> და ა.შ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("130", "იოლი ნადავლი", "", "", "იოლი", "A", "", "ნადავლი", "S", "NC", "", "ტურა იკვებება ლეშით – ესე იგი, ურჩევნია <b>იოლი ნადავლი</b>.", "მეოცე წუთზე ვაჩუსეკმა ვან ბუიტენს კარგად უპასა, მაგრამ კაპიტნის დარტყმა ვიმბეს <b>იოლი ნადავლი</b> გახდა.", "ყიფიანისა და დიღმელაშვილის შორეული დარტყმები ან მცველებს ხვდებოდა, ანაც ლომაიას <b>იოლი ნადავლი</b> ხდებოდა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("131", "ცაცხვის ხე", "", "", "ცაცხვის", "N", "", "ხე", "S", "PC", "", "ჩვენი სახლი შორს, ჩვენი <b>ცაცხვის ხე</b> ბებერი, ჩვენი ძაღლი ბრმა …", "სახრჩობელა მახათაზე და <b>ცაცხვის ხე</b> ვაკეში, ტრამვაის წრესთან. ", "მე ამ მხარეში მეგებება მხოლოდ <b>ცაცხვის ხე</b> და დედაჩემი – ბალახზე რომ მიდენის ნახირის …", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("132", "შრომისუუნარობის დაზღვევა", "", "", "შრომისუუნარობის", "N", "", "დაზღვევა", "S", "PC", "", "...ანკისგან ავტომატურად გადაეცემა სადებეტო ბარათი „ვიზა ელექტრონი” ან „მაესტრო”, სიცოცხლისა და <b>შრომისუუნარობის დაზღვევა</b>. ", "...ავტომატურად გადაეცემა სიცოცხლის და <b>შრომისუუნარობის დაზღვევა</b> და ავტომატურად ირთვება SMS-ბანკი...", "უბედური შემთხვევით გამოწვეული <b>შრომისუუნარობის დაზღვევა</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("133", "აშკარა სამხილი", "", "", "აშკარა", "A", "", "სამხილი", "S", "NC", "", "ეს იყო პირველი <b>აშკარა სამხილი</b> რუსეთის ჯაშუშის წინააღმდეგ, რასაც მალე მისი დაპატიმრება მოყვა.", "ირაკლი წერეთელს <b>აშკარა სამხილი</b> არ გააჩნია იმისა, რომ ხელისუფლება დაადანაშაულოს მასზე განხორციელებულ ტერაქტში...", "...ჰუსეინის ჩამოგდების შემდგომ ამერიკელმა ინსპექტორებმა აღმოაჩინეს <b>აშკარა სამხილი</b> იმისა, რომ დიქტატორული რეჟიმი მასობრივი განადგურების იარაღის შექმნას ცდილობდა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("134", "საფოსტო სერვისი", "", "", "საფოსტო", "A", "", "სერვისი", "S", "PC", "", "თავდაპირველად ეროვნული <b>საფოსტო სერვისი</b> სახელმწიფოს განკარგულებაში იყო.", "რისთვის გვჭირდება საიმედო <b>საფოსტო სერვისი</b>? ", "...EMS კოოპერატივი ხელს უწყობს მისი წევრი ქვეყნების ურთიერთთანამშრომლობას, რათა მომხმარებლებს გაუწიონ მაღალი ხარისხის, კონკურენტუნარიანი <b>საფოსტო სერვისი</b> მსოფლიოს მასშტაბით.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("135", "რადიოაქტიური ნარჩენები", "", "", "რადიოაქტიური", "A", "", "ნარჩენები", "S", "C", "", "ამასთან, კონტროლირებადი ბირთვული ჯაჭვური რეაქციის შემდეგ, რჩება <b>რადიოაქტიური ნარჩენები</b>, რომელთა უტილიზაციაც სერიოზულ პრობლემას წარმოადგენს.", "რადიოაქტივობის თვალსაზრისით საშიში იყო მხოლოდ 700 გ გადამუშავებული ურანი, ე.ი. <b>რადიოაქტიური ნარჩენები</b>.", "ატომურ ენერგიას აქვს ერთი დიდი უარყოფითი მხარე – მას მუდამ თან ახლავს <b>რადიოაქტიური ნარჩენები</b>, რომელთაც ვერ მოიცილებ იოლად.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("136", "საფოსტო მომსახურება", "", "", "საფოსტო", "A", "", "მომსახურება", "S", "PC", "", "ანეკდოტური ფაბულა მხოლოდ იქ შეიძლება შეიქმნას, სადაც ბუნებრივი პირობების გამო გაძნელებულია <b>საფოსტო მომსახურება</b>. ", "ეს ხალხი მიეჩვია იმას, რომ საზღვარგარეთ აწყობილია <b>საფოსტო მომსახურება</b> და ამასვე ითხოვენ საქართველოშიც.", "ცხადია, ამას ახალი სკანდალი მოჰყვა და <b>საფოსტო მომსახურება</b> კვლავ კერძო კომპანიებს გადასცეს...", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("137", "საბაზრო ადგილი", "", "", "საბაზრო", "A", "", "ადგილი", "S", "PC", "", "მიზანში იყო ამოღებული <b>საბაზრო ადგილი</b> და ჯანდაცვის ცენტრი.", "ასე მაგალითად, <b>საბაზრო ადგილი</b>, რომელიც ხშირად გვეჩვენება, როგორც პატარა, მწირი იმისათვის, რომ უზრუნველვყოთ საკმაო გაყიდვების მოცულობა ერთი ქვეყნის ფარგლებში, შეიძლება ფლობდეს მნიშვნელოვან პოტენციალს, როგორც საერთაშორისო, ასევე გლობალური აზრით.", "მე და ჩელეს ერთი <b>საბაზრო ადგილი</b> გვზონდა, თბილისს ზღვის შემოვლით გზაზე.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("138", "ავი თვალი", "", "", "ავი", "A", "", "თვალი", "S", "NC", "", "<b>ავი თვალი</b>, <b>ავი თვალი</b> გახსოვდეს ყოველ ნაბიჯზე!", "მან მარაბდელს <b>ავი თვალი</b> გადაავლო.", "განა თუ დრომან დაჰკრა თვისი მას <b>ავი თვალი</b>? ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("139", "წვიმების სეზონი", "", "", "წვიმების", "N", "", "სეზონი", "S", "PC", "", "<b>წვიმების სეზონი</b> დგას თბილისში.", "მით უმეტეს, რომ სვანეთში <b>წვიმების სეზონი</b> კვლავ გრძელდება.", "თუმცა დოკუმენტში ისიც არის მითითებული, რომ ცენტრალურ ამერიკულ ქვეყანაში <b>წვიმების სეზონი</b> 9 თვეს – აპრილიდან დეკემბრამდე – გრძელდება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("140", "ფსიქიკური აშლილობა", "", "", "ფსიქიკური", "A", "", "აშლილობა", "S", "PC", "", "მაგრამ ჯერჯერობით გამოძიებასთან ერთად მივედით დასკვნამდე, რომ ეს იყო <b>ფსიქიკური აშლილობა</b>.", "აღსანიშნავია, რომ მერაბ ჩოჩიშვილს შვილის სიკვდილის შემდეგ <b>ფსიქიკური აშლილობა</b> ჰქონდა და თავის მოკვლასაც აპირებდა.", "ყველაფერი ეს მიუთითებს, რომ იწყება <b>ფსიქიკური აშლილობა</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("141", "ბრინჯის ქაღალდი", "", "", "ბრინჯის", "N", "", "ქაღალდი", "S", "PC", "", "<b>ბრინჯის ქაღალდი</b> — მაღალი ხარისხის, თხელი, მაშრობელა, ხაოიანი ზედაპირის (ჰგავს საშრობ ქაღალდს) თეთრი ფერის ქაღალდი.", "<b>ბრინჯის ქაღალდი</b> დეკუპაჟისთვის არის თხელი ქაღალდი უხეში ზედაპირით...", "საუკეთესო <b>ბრინჯის ქაღალდი</b> მზადდება სრულად ბუნებრივი ინგრედიენტებისგან...", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("142", "საშუალო სკოლა", "", "", "საშუალო", "A", "", "სკოლა", "S", "C", "", "ქუთაისის რომელიღაც <b>საშუალო სკოლა</b> მოვიდა ჩარგალში.", "როგორც იქნა, ჩათავდა ძნელად გასაღწევი ათი წელი, <b>საშუალო სკოლა</b> დაამთავრა.", "1994 წელს დაამთავრა თბილისის 46-ე <b>საშუალო სკოლა</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("143", "სარძევე კბილი", "", "", "სარძევე", "A", "", "კბილი", "S", "PC", "", "ბავშვს პირველი <b>სარძევე კბილი</b> 4-6 თვის ასაკში ამოსდის და 2 წლისას მას უკვე 20 კბილი აქვს.", "ორი წლის ასაკში ბავშვებს ოცივე <b>სარძევე კბილი</b> აქვთ. ", "ღმერთმა ააშენოს მათი ოჯახები, რაც იმის ღეჭვა დავიწყე, ოთხი საღეჭი და ორი <b>სარძევე კბილი</b> ამომივიდა 65 წლის ასაკში. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("144", "შენახვის ვადა", "", "", "შენახვის", "N", "", "ვადა", "S", "NC", "", "ჩვენთან საუბარში განაცხადა: „ამ პურს ცელოფანი აქვს შემოკრული და ზედ აწერია: <b>შენახვის ვადა</b> 32 საათი'.", "ამით გაჯერებული მარილის <b>შენახვის ვადა</b> ერთ წლამდეა.", "ქართული არაჟნის <b>შენახვის ვადა</b> 72 საათია. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("145", "სიჩქარის ლიმიტი", "", "", "სიჩქარის", "N", "", "ლიმიტი", "S", "NC", "", "...საქართველოს პარლამენტს საკანონმდებლო ინიციატივით მიმართავს, რომლის თანახმადაც, 90 კმ/სთ <b>სიჩქარის ლიმიტი</b> 80 კმ/სთ სიჩქარემდე შემცირდება. ", "აქ <b>სიჩქარის ლიმიტი</b> იზრდება 80 კმ/სთ-მდე განურჩევლად ყველა საშუალებისთვის (მოტოციკლი, სატვირთო, სამარშრუტო).", "შეიცვალოს დასახლებულ პუნქტებში <b>სიჩქარის ლიმიტი</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("146", "კანის ფერი", "", "", "კანის", "N", "", "ფერი", "S", "NC", "", "ხმელ-ხმელი იყო და <b>კანის ფერი</b> ბრინჯაოს უგავდა, როგორც ყველას, ვინც სოფელში მზის გულზე ცხოვრობს.", "პირაღმა იწვა და მბჟუტავი სანთლის შუქზე კარგად გაარჩია ესოდენ ახლობელი <b>კანის ფერი</b>, რომელსაც ასე სუნთქვაშეკრული მიელტვოდა. ", "რაღაც <b>კანის ფერი</b> არ მომწონს მაგისი..", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("147", "მშობლიური ენა", "", "", "მშობლიური", "A", "", "ენა", "S", "NC", "", "ეს იმას ნიშნავს, რომ შენი <b>მშობლიური ენა</b> არ იცი კარგად. ", "ჩვენ უნდა წავართვათ მათ <b>მშობლიური ენა</b>, მაგრამ ჩვენ არ შეგვიძლია, ავუკრძალოთ მათ მასზე საუბარი.", "სოციალური მოთხოვნილებანი, სამოქალაქო ძალაუფლება <b>მშობლიური ენა</b> ყოველთვის არსებობს. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("148", "კალიგრაფიის კონკურსი", "", "", "კალიგრაფიის", "N", "", "კონკურსი", "S", "NC", "", "<b>კალიგრაფიის კონკურსი</b> სამ ტურს მოიცავს.", "<b>კალიგრაფიის კონკურსი</b> მეორე წელია ტარდება და წელს კიდევ უფრო გაზრდილია მისი არეალი. ", "ქართული <b>კალიგრაფიის კონკურსი</b> სამ ეტაპად ჩატარდება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("149", "ვიწრო გასასვლელი", "", "", "ვიწრო", "A", "", "გასასვლელი", "S", "PC", "", "უბაშმა ერთს სიმაგრესთან <b>ვიწრო გასასვლელი</b> მტკიცედ ჩაუხერგა მიმლტოლვარე მტერს.", "ფრთხილად გაიარა <b>ვიწრო გასასვლელი</b> მაგიდასა და საწოლს შორის.", "გაწევასთან ერთად გამოჩნდა <b>ვიწრო გასასვლელი</b>.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("150", "წმინდა შემოსავალი", "", "", "წმინდა", "A", "", "შემოსავალი", "S", "PC", "", "გაძლიერდა გოგებაშვილი ქონებრივადაც: ყველა თავის წიგნებიდგან ყოველწლიური <b>წმინდა შემოსავალი</b> ჰქონდა სამი ათას-ოთხი ათას მანეთამდე.", "...მარტო ის ვიგულისხმოთ, რომ იმ ასს წევრს ორთაშუა რიცხვით ას-ასი თუმანი <b>წმინდა შემოსავალი</b> აღმოუჩნდა.", "რაც ბ-ნ მინისტრისაგან შარშან ქაღალდი მოუვიდათ, სოფლის მამულის <b>წმინდა შემოსავალი</b> უნდა აიღონ 142/7 – ჯერ და არა 162/3 – ჯერ როგორც აქამდე იყო. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("151", "სართავი მანქანა", "", "", "სართავი", "N", "", "მანქანა", "S", "NC", "", "<b>სართავი მანქანა</b> – ჯეიმს ჰარგრივზი, როდიონ გლინკოკი – 1760-70 წ.", "... სიმღერასთან „მერის ჰყავდა ცხვარი”. ა) მერი პიკფორდის შლაპა; ბ) ანბანი უსინათლოთათვის; გ) <b>სართავი მანქანა</b>; დ) ფონოგრაფი...", "ვინ და როდის გამოიგონა ძაფის <b>სართავი მანქანა</b>?", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("152", "კვამლის საბურველი", "", "", "კვამლის", "N", "", "საბურველი", "S", "NC", "", "„კიევის რეჟიმის აშკარა უუნარობა გონს მოეგოს და შეწყვიტოს ატომური ელექტროსადგურისთვის საფრთხის შექმნა, იწვევს უდიდეს შეშფოთებას, რომ რუსეთის ფედერაციის წინააღმდეგ მისი პროვოკაციული ბრალდებები სხვა არაფერია, თუ არა <b>კვამლის საბურველი</b> ზაპოროჟიეს ატომურ ელექტროსადგურზე რეალური ავარიის განსახორციელებლად მზადების დასამალად“, - ნათქვამია ვასილი ნებენზიას მიერ გავრცელებულ წერილში.", "მის ცხოვრებაში ყველაფერს სიგარეტის გემო და სუნი ჰქონდა. რა თემაზეც არ უნდა გველაპარაკა, გარშემო მუდამ გვერტყა სიგარეტის <b>კვამლის საბურველი</b>. ", "", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("153", "სოციალური დაზღვევა", "", "", "სოციალური", "A", "", "დაზღვევა", "S", "PC", "", "სხვათა შორის, <b>სოციალური დაზღვევა</b> „ჯიპიაი ჰოლდინგის” პრიორიტეტია. ", "სიღარიბესთან ბრძოლა, შემოსავლების გათანაბრება და <b>სოციალური დაზღვევა</b>.", "აშშ-შიც უჭირთ, 70 მილიონი ადამიანია იქ, რომელსაც არ აქვს <b>სოციალური დაზღვევა</b>. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("154", "გედის სიმღერა", "", "", "გედის", "N", "", "სიმღერა", "S", "PC", "", "თუ აქამდე <b>გედის სიმღერა</b> არავის სმენია, ტირილიც ხომ არავის გაუგონია?", "<b>გედის სიმღერა</b> ხომ არ დამეწერაო, გაიფიქრა, მაგრამ გაეცინა ამ ფიქრზე.", "გამეფებულ საღამოს სიჩუმეში <b>გედის სიმღერა</b> გაისმა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("155", "საინფორმაციო სააგენტო", "", "", "საინფორმაციო", "A", "", "სააგენტო", "S", "NC", "", "ნინო ბურჯანაძემ ეს განცხადება დღეს რუს ჟურნალისტებთან საუბრისას განაცხადა, იტყობინება <b>საინფორმაციო სააგენტო</b> „პრაიმ ნიუსი”. ", "ჩვენი <b>საინფორმაციო სააგენტო</b> - აქ ყოველგვარი ცნობის მიღება შეგიძლია.", "რუსული <b>საინფორმაციო სააგენტო</b> ძირითადად აფხაზეთის დეფაქტო ხელისუფლების წარმომადგენელთა ცნობებს ეყრდნობა. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("156", "საცურაო აუზი", "", "", "საცურაო", "A", "", "აუზი", "S", "C", "", "ან, საერთოდ, დაანგრიოს და ისტორიული ძეგლის ადგილას ახალი სასტუმრო ან <b>საცურაო აუზი</b> ააშენოს … ", "თეთრ სახლს, ასევე, აქვს ჩოგბურთის კორტი, სარბენი ბილიკი, <b>საცურაო აუზი</b>, კინო-თეატრი, ბილიარდის დარბაზი და ბოულინგის ბილიკები.", "მთელს საქართველოში ერთადერთი, ზამთრის <b>საცურაო აუზი</b> კი (ვაკის) უკვე რვა წელიწადია, უქმად არის.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("157", "ინერტული აირი", "", "", "ინერტული", "A", "", "აირი", "S", "PC", "", "<b>ინერტული აირი</b> არის აირი, რომელიც არ განიცდის ქიმიურ რეაქციებს მოცემულ პირობებში.", "რაც აქამდე არ იცოდით – ყველაზე საშინელი <b>ინერტული აირი</b>.", "მათ ეს <b>ინერტული აირი</b> გამოყვეს «გამორიცხვის მეთოდით», მას შემდეგ რაც ჰაერიდან ჟანგბადი, აზოტი და ყველა შედარებით მძიმე კომპონენტი გადააქციეს სითხედ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("158", "ანალიტიკური ცენტრი", "", "", "ანალიტიკური", "A", "", "ცენტრი", "S", "NC", "", "„ახლებმა” მიიღეს აგრეთვე გადაწყვეტილება ჩამოაყალიბონ <b>ანალიტიკური ცენტრი</b>.", "აქედან გამომდინარე, ზბიგნევ ბჟეზინსკის ზემძლავრი „<b>ანალიტიკური ცენტრი</b>” შესაბამის რეკომენდაციებსაც გამოიმუშავებს ადმინისტრაციის საყურადღებოდ.", "თბილისის სტრატეგიული და უსაფრთხოების კვლევის ცენტრი არის <b>ანალიტიკური ცენტრი</b>, რომლის მიზანს სტრატეგიულ და უსაფრთხოების სფეროში გამჭვირვალობის გაზრდა წარმოადგენს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("159", "ვიდეო თამაში", "", "", "ვიდეო", "N", "", "თამაში", "S", "PC", "", "პირველი <b>ვიდეო თამაში</b> იყო შპაცეჭარს, რომელიც შექმნა მასაჩუსეტის ტექნოლოგიური ინსტიტუტის სტუდენტმა სტივ რასელმა...", "ეს არის უბრალო <b>ვიდეო თამაში</b>, რომლის მიზანია განათლების მიცემა და ზრუნვა ელექტრონულ აღსაზრდელზე.", "<b>ვიდეო თამაში</b> — ელექტრონული თამაში, რომელიც ითვალისწინებს ადამიანთან ინტერაქტიულ კავშირს და ვიზუალური გამომოსახულებისთვის ესაჭიროება ვიდეო მოწყობილობა, როგორიც არის სტანდარტული ტელევიზორი ან კომპიუტერის მონიტორი.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("160", "გადარეული ადამიანი", "", "", "გადარეული", "A", "", "ადამიანი", "S", "NC", "", "ეს 7 <b>გადარეული ადამიანი</b> ანდრეას სახელს ბოლო ხმაზე ყვიროდნენ და ამხნევებდნენ.", "მე მინდა ზუსტად ასეთი <b>გადარეული ადამიანი</b> ვიყო, რომ შევცვალო რეალობა.", "ახლა იქ შემორჩა და ვერ ჩამოდის. ძალიან <b>გადარეული ადამიანი</b> ვარ და მინდა, გულწრფელი ვიყო: ჩემს მეუღლეზე უფრო მეტი ამაგი მაქვს, ვიდრე ცხრა შვილზე ერთად და მიყვარს კიდეც.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("161", "ვებ საიტი", "", "", "ვებ", "N", "", "საიტი", "S", "PC", "", "ინვესტორს შეუძლია ერთი კომპიუტერი იყიდოს და ერთი <b>ვებ საიტი</b> გამოაქვეყნოს და ეს საინვესტიციო პირობების შესრულებად ჩაეთვლება.", "თუმცა უკვე შეიქმნა <b>ვებ საიტი</b>, სადაც თეატრალური ინტერნეტგაზეთის განთავსებას ვფიქრობთ (თუ შევძლებთ, ორენოვანის)...", "...შემდეგ კი გადაწყვიტა ისეთი <b>ვებ საიტი</b> შეექმნა, რომელიც დაეხმარებოდა ადამიანს სასურველი სამუშაოს შოვნაში. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("162", "ცრემლსადენი გაზი", "", "", "ცრემლსადენი", "A", "", "გაზი", "S", "PC", "", "სამართალდამცავებმა გამოიყენეს ჯერ წყლის ჭავლი და შემდეგ <b>ცრემლსადენი გაზი</b>.", "ამ ჩამონათვალში შედის <b>ცრემლსადენი გაზი</b>, წყლის ჭავლი და რეზინის ხელკეტი, თუმცა კანონში არ წერია რეზინის ტყვიები.", "ამ სიაში შედის <b>ცრემლსადენი გაზი</b>, წყლის ჭავლი და რეზინის ხელკეტები, თუმცა არ შედის რეზინის ტყვიები.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("163", "ძველი სიყვარული", "", "", "ძველი", "A", "", "სიყვარული", "S", "NC", "", "აწ გზა მიტოვებულია, როგორც <b>ძველი სიყვარული</b>. ", "ჩათვალა, რომ <b>ძველი სიყვარული</b> გაუცოცხლდა.", "რა მოხდა, მერე, <b>ძველი სიყვარული</b> გაიხსენოს?!", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("164", "დროში სხვაობა", "", "", "დროში", "N", "", "სხვაობა", "S", "NC", "", "ორ მიწისძვრას შორის <b>დროში სხვაობა</b> 11 წუთი იყო.", "რიგელებმა დარჩენილ <b>დროში სხვაობა</b> მხოლოდ მინიმუმამდე დაიყვანეს – 2:3. ", "ასეც მოხდა: ჯორჯიელებმა პირველივე პერიოდში 32:15 მოიგეს და დარჩენილ <b>დროში სხვაობა</b> კიდევ უფრო გაზარდეს. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("165", "კარგად ცნობილი", "", "", "კარგად", "ADV", "", "ცნობილი", "S", "NC", "", "კაცობრიობისთვის <b>კარგად ცნობილი</b> დანაშაული, რომელსაც სიამოვნებით ჩაიდენდით … ", "მაშინ სპარსეთის დიდ მეფედ გახდა ისტორიაში <b>კარგად ცნობილი</b>: დარიოს.", "ამისათვის კი ერთი პირადად ჩემთვის საზიზღარი და ყველასათვის <b>კარგად ცნობილი</b> ასოციაცია მინდა მოვიშველიო. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("166", "ფეხით გადასასვლელი", "", "", "ფეხით", "N", "", "გადასასვლელი", "S", "NC", "", "კარგი იქნება თუ ვაჟა-ფშაველასა და გამსახურდიას გადაკვეთაზე გაკეთდება <b>ფეხით გადასასვლელი</b>.", "საქართველოში ცხოვრება ძალიან უჭირთ, განსაკუთრებით ზამთარში, როცა დაღესტანში <b>ფეხით გადასასვლელი</b> მოკლე გზა იკეტება.", "ექვს თვეში ახალი ხიდი აიგება ლალი ქინქლაძე ვაგზლის მოედანზე, ბორჯომის სადგურთან, <b>ფეხით გადასასვლელი</b> ხიდის რეკონსტრუქციისა და მიმდებარე სივრცის მოწესრიგებისათვის...", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("167", "მოძრაობის კონტროლი", "", "", "მოძრაობის", "N", "", "კონტროლი", "S", "PC", "", "...საქართველოს ტერიტორიაზე ტვირთის დანიშნულების ადგილამდე <b>მოძრაობის კონტროლი</b> და შესაბამისი დოკუმენტაციის გაფორმება...", "...ფირმის სახელით მოეხდინათ საქართველოს ტერიტორიაზე ტვირთის დანიშნულების ადგილამდე <b>მოძრაობის კონტროლი</b> და შესაბამისი დოკუმენტაციის გაფორმება...", "შესაბამისად, ჩვენ ვაყენებთ პირობას, ტვირთების <b>მოძრაობის კონტროლი</b> ქვეყნის ეკონომიკური საზღვრის მთელ პერიმეტრზე – როკის გვირაბისა და ფსოუს ჩათვლით იყოს უზრუნველყოფილი.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("168", "სატელეფონო წიგნი", "", "", "სატელეფონო", "A", "", "წიგნი", "S", "C", "", "ამ წერილს მოაყოლა გაგრის <b>სატელეფონო წიგნი</b> და თქვა, რომ აი, ეს არის ერთადერთი ნივთი, რაც სახლიდან შემომრჩაო.", "ავიღეთ <b>სატელეფონო წიგნი</b> და პირველ, ბრმად არჩეულ ნომერზე დავრეკეთ.", "1880 წელი – ლონდონის სატელეფონო კომპანიამ გამოუშვა პირველი <b>სატელეფონო წიგნი</b>, სადაც 255 სახელი შევიდა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("169", "მოგზაურობის გზამკვლევი", "", "", "მოგზაურობის", "N", "", "გზამკვლევი", "S", "NC", "", "პირსახოციანი სულელები: „ვარსკვლავური ომების” წინააღმდეგ: გალაქტიკის გარშემო ავტოსტოპით <b>მოგზაურობის გზამკვლევი</b>...", "საბიუჯეტო <b>მოგზაურობის გზამკვლევი</b> ახალ ზელანდიაში.", "<b>მოგზაურობის გზამკვლევი</b> ლოს ანჯელესში მოგზაურობის სახელმძღვანელო ლოს ანჯელესში.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("170", "ბალიშის გადასაფარებელი", "", "", "ბალიშის", "N", "", "გადასაფარებელი", "S", "NC", "", "ბამბის <b>ბალიშის გადასაფარებელი</b> ატლასის ან აბრეშუმის ზეწრით შეცვალეთ", "100% სუფთა თეთრეულის <b>ბალიშის გადასაფარებელი</b>.", "დილით ძვირფასი დრო რომ დაზოგოთ აუცილებელია ბამბის <b>ბალიშის გადასაფარებელი</b>, ატლასის ან აბრეშუმის ზეწრით ჩაანაცვლოთ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("171", "ქორწინების წლისთავი", "", "", "ქორწინების", "N", "", "წლისთავი", "S", "PC", "", "შემდეგ ძირითად წელს ნებადართულია ყოველთვიურად აღნიშნოთ „<b>ქორწინების წლისთავი</b>“.", "პრეზიდენტის ქალიშვილის და გიგი ჩიჩუას სკანდალური <b>ქორწინების წლისთავი</b>", "ადრიანო ჩელენტანომ და კლაუდია მორიმ ოქროს <b>ქორწინების წლისთავი</b> აღნიშნეს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("172", "უბის წიგნაკი", "", "", "უბის", "N", "", "წიგნაკი", "S", "PC", "", "პარმენმა <b>უბის წიგნაკი</b> იშიშვლა და სწრაფად ჩაიწერა.", "აბელმა <b>უბის წიგნაკი</b> დააძრო, გადაშალა და ისევ შეინახა.", "ავტობუსიდან რომ ჩამოხტა, ტყავის ჩანთიდან ცარცი და <b>უბის წიგნაკი</b> ამოიღო, პირველივე ბოძთან მივიდა და „35” დააწერა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("173", "ქორწილის დღე", "", "", "ქორწილის", "N", "", "დღე", "S", "PC", "", "ნანულისთან ცოტა ჭკვიანად მოვიქეცი, ჯერ ფლირტაობა დავუწყე, თავი შევაყვარე და <b>ქორწილის დღე</b> რომ უნდა დაგვენიშნა, მაშინ გავუმხილე ჩემი „ნაკლი”.", "<b>ქორწილის დღე</b> დანიშნეს.", "მოკლედ, ახლოვდებოდა <b>ქორწილის დღე</b> და, ვაი, ამ მოახლოებას.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("174", "ციხის მცველი", "", "", "ციხის", "N", "", "მცველი", "S", "PC", "", "გუშაგი <b>ციხის მცველი</b>, მეციხოვნე; ყარაული.", "საკანში ქონდართუხუცესი და <b>ციხის მცველი</b> რაზა შემოვიდნენ. ", "<b>ციხის მცველი</b> დაეჯაჯგურა, ახლავე წამომყევიო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("175", "პატიმრობის ვადა", "", "", "პატიმრობის", "N", "", "ვადა", "S", "PC", "", "კობა დავითაშვილის განცხადებით, ამ პიროვნებებს წინასწარი სამთვიანი <b>პატიმრობის ვადა</b> უკვე გაუვიდათ.", "იგი შარშან გაათავისუფლეს პატიმრობიდან მას შემდეგ, რაც მისი <b>პატიმრობის ვადა</b> ამნისტიის შედეგად შემცირდა.", "კონსტიტუციის თანახმად, ბრალდებულის წინასწარი <b>პატიმრობის ვადა</b> 9 თვეს არ უნდა აღემატებოდეს. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("176", "სუფთა სული", "", "", "სუფთა", "A", "", "სული", "S", "NC", "", "მხოლოდ მასზე არა აქვს ბეჭედს დამღუპველი გავლენა, იმდენად უბრალო და <b>სუფთა სული</b>, იმდენად ძლიერი ნება აღმოაჩნდა მას.", "ოღონდ კაცმა უნდა მოინანიოს და მისი ბავშვივით <b>სუფთა სული</b> მზად იქნება ყველაფრის მისაღებად.", "ვიცი, შენ ყოველთვის გჯეროდა ჩემი და ახლაც ვიცი, რომ ცასავით <b>სუფთა სული</b> გაქვს და კიდევ გჯერა ჩემი. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("177", "პირადი თვალი", "", "", "პირადი", "A", "", "თვალი", "S", "NC", "", "სადლიხა მეაბჯრე აგრაგვისაკენ გაჰყვა ქალბ-აღი-ხანს, როგორც შაჰის <b>პირადი თვალი</b>.", "", "", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("178", "ზამთრის ბუნიობა", "", "", "ზამთრის", "N", "", "ბუნიობა", "S", "PC", "", "როგორ უნდა გაატაროთ <b>ზამთრის ბუნიობა</b> - ყველაზე მოკლე დღე და ჯადოსნური ღამე.", "<b>ზამთრის ბუნიობა</b> ყოველწლიურად 21 დეკემბერს ხდება და ის მსოფლიო მასშტაბის მოვლენაა.", "<b>ზამთრის ბუნიობა</b> დღეა და კარნაკის ტაძარიც ასე საიცრად განათდება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("179", "ჩანაწერების წიგნი", "", "", "ჩანაწერების", "N", "", "წიგნი", "S", "PC", "", "მისი <b>ჩანაწერების წიგნი</b>, მისი დღიური ზეპირად იცოდა …", "ასევე აუქციონიდან 90 ათას დოლარად გაიყიდა მსახიობის <b>ჩანაწერების წიგნი</b>.", "მაშინ მისი სახლი, ოფისი და მანქანა გაჩხრიკეს და პასპორტი, დიპლომი, <b>ჩანაწერების წიგნი</b> და სხვადასხვა ჟურნალისტური ნაშრომები ამოიღეს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("180", "მსოფლიო კონფერენცია", "", "", "მსოფლიო", "N", "", "კონფერენცია", "S", "PC", "", "1993 წელს ვენაში გაეროს ეგიდით ადამიანის უფლებათა დაცვის სფეროში <b>მსოფლიო კონფერენცია</b> ჩატარდა.", "მომავალი (ე.ი. 1996) წლის სექტემბრის 12-18 რიცხვებში დაგეგმილია მე-7 <b>მსოფლიო კონფერენცია</b>, რომელიც ჩატარდებოდა ოქსფორდში...", "მერმის შემოდგომაზე (სექტემბერსა ან ოქტომბერში) თბილისში გაიმართება <b>მსოფლიო კონფერენცია</b>, რომლის მიზანი იქნება რაიტთერაპიის დაკავშირება ისეთ მძიმე მოვლენასთან...", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("181", "ანტიკური ისტორია", "", "", "ანტიკური", "A", "", "ისტორია", "S", "PC", "", "თანამედროვე პოლიტიკური თეორია ხანდახან ნაკლებადაა გამოსადეგი, ვიდრე, მაგალითად, <b>ანტიკური ისტორია</b>. ", "ხშირად, <b>ანტიკური ისტორია</b> დრამატულ სცენად იქცევა ხოლმე, არა ისეთად როგორც ეს ნამდვილად მოხდა, არამედ როგორც ეს ავტორს წარმოუდგენია რომ მოხდებოდა. ", "ქართული ღვინო მარსიანელებსაც გააბედნიერებს და ვიღაც, შუა ხნის მამაკაცი ალბათ მომავალი 8000 წლის შემდეგ დაჯდება და იმ მილენიუმელებისთვის მოკლედ მოყვება როგორ დაიწყო ქართული ღვინის მარსისთვის <b>ანტიკური ისტორია</b> საბჭოეთის გავლით, უკვე ალბათ სატურნამდე.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("182", "კვლევითი ლაბორატორია", "", "", "კვლევითი", "A", "", "ლაბორატორია", "S", "C", "", "მათ არ იციან ასევე, არის თუ არა ზუგდიდში <b>კვლევითი ლაბორატორია</b>, სადაც წყლის შემოწმებას შეძლებდნენ...", "ამ მეთოდით, მათ თსუ-ში ყველა <b>კვლევითი ლაბორატორია</b> გააუქმეს.", "...დავაარსე სპეციალობა „ლაზერების ფიზიკა” და შევქმენი სამეცნიერო <b>კვლევითი ლაბორატორია</b>. ", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("183", "იმედის სხივი", "", "", "იმედის", "N", "", "სხივი", "S", "NC", "", "<b>იმედის სხივი</b> დასტოვა ჩვენ დაღონებულ ყოფაში, აწ დიდებულო სარდალო ჩვენის ლაშქრისა! ", "უცბად, რატომაც არა, <b>იმედის სხივი</b> ჩაუდგა თვალებში, რამაც, თითქოს, წამიერად, მთელი უკუნი შთანთქა.", "პრობლემებით არ უნდა დახუნძლო იგი, მას <b>იმედის სხივი</b> უნდა დაუტოვო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("184", "წვრილი თევზი ", "", "", "წვრილი", "A", "", "თევზი", "S", "NC", "", "ნავის ფსკერს ორიოდე <b>წვრილი თევზი </b>თუ უბათქუნებდა კუდს, უარესად რომ გაებოროტებინა ხელმოცარული მეთევზეები.", "არცერთი მფრინავი თევზი არ არხევდა წყლის სარკეს, არც <b>წვრილი თევზი </b>ჩანდა.", "აქ იყო უმი, წვრილი თევზი, „ბარბაროსული” ბრინჯისა და პურის ფქვილის კვერები...", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("185", "საღი განსჯა", "", "", "საღი", "A", "", "განსჯა", "S", "C", "", "ოღონდ ხომ არსებობს – უნდა არსებობდეს – <b>საღი განსჯა</b>, ობიექტურობის გრძნობა და ამათ რა ვუყოთ …", "ცხადია, აქ იქნება მხოლოდდამხოლოდ შეთანხმება და <b>საღი განსჯა</b> იმ საკითხისა.", "მხოლოდ ემოციებზე დამყარებული ქმედება სიკეთეს ვერ მოგვიტანს, ემოციებს გონება და <b>საღი განსჯა</b> უნდა აკონტროლებდეს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("186", "გაზიანი წყალი", "", "", "გაზიანი", "A", "", "წყალი", "S", "NC", "", "გამყიდველ ქალს მაინც არ აცალა გონს მოსვლა მიხომ, ისე წააგლიჯა ბოთლს თავსახური და <b>გაზიანი წყალი</b> შხეფებად ზედ სახეზე მიუშვა.", "მარიამ დაიბარა, ვინც მიკითხოს, სანაპიროზე გავიდეს და <b>გაზიანი წყალი</b> დალიოსო.", "მან ცოტა ვისკი დაისხა, <b>გაზიანი წყალი</b> დაამატა და მოსვა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("187", "ქუჩის გოგო", "", "", "ქუჩის", "N", "", "გოგო", "S", "PC", "", "ამჟამად თუ ჩემს ქალბატონს მიველტვი, ხვალ მის ადგილას <b>ქუჩის გოგო</b> იქნება.", "როგორ ძალადობს ქართველი '<b>ქუჩის გოგო</b>' ბავშვზე, დაქალი კი იცინის და ვიდეოს უღებს.", "თუ სცენაზე ინტიმურ სცენას ვთამაშობ, მაყურებელი ფიქრობს, რომ <b>ქუჩის გოგო</b> ვარ.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("188", "მეტროს სისტემა", "", "", "მეტროს", "N", "", "სისტემა", "S", "PC", "", "ამჟამად თბილისის <b>მეტროს სისტემა</b> ფართომასშტაბიანი რეკონსტრუქციის პროცესშია...", "ეს არის <b>მეტროს სისტემა</b> RP სერვერებს ძალიან გამოგადგებათ ?", "თბილისის მეტროპოლიტენი — სწრაფი ტრანზიტის <b>მეტროს სისტემა</b> თბილისში 1966 წელს გაიხსნა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("189", "ჩოგბურთის იდაყვი", "", "", "ჩოგბურთის", "N", "", "იდაყვი", "S", "NC", "", "<b>ჩოგბურთის იდაყვი</b>, ან გვერდითი ეპიკონდილიტი, არის იდაყვის სახსრის მტკივნეული ანთება, რომელიც გამოწვეულია განმეორებითი სტრესით (გადაჭარბებული გამოყენება). ", "<b>ჩოგბურთის იდაყვი</b>, ასევე ცნობილი როგორც გვერდითი ეპიკონდილიტი, არის მტკივნეული მდგომარეობა, რომელიც გამოწვეულია იდაყვის გადაჭარბებული გამოყენებით აწევისას, დაჭერისას ან დაჭერისას. სიმპტომები ძირითადად იგრძნობა მხრის გარე (გვერდითი) ნაწილზე იდაყვის მახლობლად დომინანტურ მხარეს.", "უმეტესად <b>ჩოგბურთის იდაყვი</b> თავისით იკურნება, თუკი ის დაკავშირებულია მტკივნეულ ადგილას გარკვეულ მოსვენებასთან, იდაყვის მიდამოში მოცილება შეამცირებს შეშუპებას ყოველ 30 წუთში ყოველ 4 საათში, რამდენიმე დღის განმავლობაში, სანამ ტკივილი არ გაქრება, გამოიყენეთ იდაყვის სახვევი დაისვენოს მყესზე, მალამოსაწინააღმდეგო წამლებზე და ფიზიოთერაპიაზე.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("190", "სველი საბანი", "", "", "სველი", "A", "", "საბანი", "S", "NC", "", "მერე გადააფარა <b>სველი საბანი</b> მკვდარს და აჩქარებით გადაიარა ნაეზოვარი.", "თქვენ არ შეგიძლიათ პროდუქტის გადახვევა და გაწურვა. გარეცხვის შემდეგ <b>სველი საბანი</b> დადეთ დიდ ბრტყელ ზედაპირზე ან ქსოვილი ფრთხილად ჩამოკიდეთ.", "გაჟღენთილი <b>სველი საბანი</b>, მერე კი თავში იშენდა ხელებს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("191", "საბავშვო ეტლი", "", "", "საბავშვო", "A", "", "ეტლი", "S", "PC", "", "რითიც შეგვიძლია, იმით ვეხმარებით – ტანსაცმელი იქნება ეს, <b>საბავშვო ეტლი</b> თუ საფენები.", "<b>საბავშვო ეტლი</b> – სიმბოლურად. ", "რა სევდიანი სანახაობაა, – მაგი პატარა B-ს ეტლთან შედგა, – <b>საბავშვო ეტლი</b> დერეფანში გამოგორდა …", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("192", "ხატოვანი აღწერილობა", "", "", "ხატოვანი", "A", "", "აღწერილობა", "S", "PC", "", "როგორც ხედავთ, ტერმინებს გარკვეულწილად <b>ხატოვანი აღწერილობა</b> აქვს...", "შეეცადე, აქ ჩამოწერილ სიტყვებს ასეთი, მხატვრული, <b>ხატოვანი აღწერილობა</b>...", "", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("193", "კეთილთვისებიანი სიმსივნე", "", "", "კეთილთვისებიანი", "A", "", "სიმსივნე", "S", "PC", "", "2002 წლის ივლისში გრაფს ფეხიდან <b>კეთილთვისებიანი სიმსივნე</b> ამოკვეთეს.", "<b>კეთილთვისებიანი სიმსივნე</b> აუცილებლად უნდა ამოიკვეთოს? ", "ანუ შესაძლებელია, რომ <b>კეთილთვისებიანი სიმსივნე</b> გარკვეული დროის შემდეგ ავთვისებიანში გადაიზარდოს?", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("194", "დიდი თევზი", "", "", "დიდი", "A", "", "თევზი", "S", "NC", "", "ძალიან <b>დიდი თევზი</b> თუ შეგხვდება, ჩვენ მოგეხმარებით. ", "ძალიან <b>დიდი თევზი</b> რომ შეგვხვდეს, ღონე გეყოფა?", "მერე მოხუცს შეეცოდა <b>დიდი თევზი</b>, რომელიც ანკესით დაიჭირა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("195", "აპლიკაციის ფორმა", "", "", "აპლიკაციის", "N", "", "ფორმა", "S", "C", "", "აღნიშნულ ბროშურაში ასახულია <b>აპლიკაციის ფორმა</b>, რითაც ადამიანს შეუძლია მიმართოს ევროსასამართლოს.", "<b>აპლიკაციის ფორმა</b> საქართველოში ვიზიტისთვის.", "აშშ-ის სავიზო <b>აპლიკაციის ფორმა</b> გამკაცრდა.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("196", "შავი ალუბალი", "", "", "შავი", "A", "", "ალუბალი", "S", "NC", "", "შეიძინეთ <b>შავი ალუბალი</b>.", "", "<b>შავი ალუბალი</b> და შავი შოკოლადი ვანილისა და სანელებლების შეფუთვით.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("197", "ბალანსის ფურცელი", "", "", "ბალანსის", "N", "", "ფურცელი", "S", "PC", "", "დღე, როდესაც სამყურებმა 111 წლიანი უარყოფითი <b>ბალანსის ფურცელი</b> გადაშალეს.", "ტრადიციულ გაგებაში, <b>ბალანსის ფურცელი</b> კომპანიის ფინანსურ ანგარიშზე დარიცხვისა და ხარჯების ოდენობას შორის განსხვავებაა.", "როგორ არის <b>ბალანსის ფურცელი</b>?", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("198", "საბანკო ანგარიში", "", "", "საბანკო", "A", "", "ანგარიში", "S", "C", "", "რადგან სკოლა სრულფასოვანი დაწესებულება არ იყო, მას არ ჰქონდა საკუთარი <b>საბანკო ანგარიში</b>.", "დადხა ადასტურებს, რომ ირანის მთავრობამ ეს <b>საბანკო ანგარიში</b> გაყინა და ანგარიშიდან ფულის გატანა შესაძლებელი არ არის.", "...მისივე თქმით, კომპანიების პარალიზებას იწვევს და მფლობელები ყველაფერზე მიდიან, რათა <b>საბანკო ანგარიში</b> კვლავ ამუშავდეს.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("199", "ბრალდების თამაში", "", "", "ბრალდების", "N", "", "თამაში", "S", "NC", "", "ევროკავშირისა და თურქეთის <b>ბრალდების თამაში</b> მეორე ტურში შედის. ", "<b>ბრალდების თამაში</b> შენგან მსხვერპლს ქმნის.", "", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("200", "სპილენძის ბეჭედი", "", "", "სპილენძის", "N", "", "ბეჭედი", "S", "NC", "", "წამოიცვა თითზე <b>სპილენძის ბეჭედი</b>, ჩასდო სპილენძის ქვაბში სათანადო სუნნელებანი (და აქ აღწერილია მათი შემადგენლობა)...", "", "", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("201", "აგურის კედელი", "", "", "აგურის", "N", "", "კედელი", "S", "PC", "", "ბოლოს ნაგაზი შემოისროლა მორევში, რომელსაც მტკვარში შეჭრილი <b>აგურის კედელი</b> აჩენდა.", "იმ კონკრეტულ შემთხვევაში, ინგოროყვას ქუჩაზე, ფასადის 40 მეტრ სიგრძეზე მზიდი <b>აგურის კედელი</b> განივი მხრიდან მზიდი კედლებით არის შეკრული...", "თავით გატეხილი <b>აგურის კედელი</b> პაპუნა კედია ადრიანო მადლობელია!", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("202", "ქოლ-ცენტრი", "", "", "ქოლ", "N", "", "ცენტრი", "S", "C", "", "ამის გაკეთება შესაძლებელია მაგთიკომის ოფისებში მისვლით, ტელეფონით (<b>ქოლ-ცენტრი</b> 1191, 032217 00 00), ან ონლაინ-რეჟიმში „მაგთისატის” ვებგვერდზე.", "ბევრნაირი <b>ქოლ-ცენტრი</b> არსებობს, ჩვენ ამის წინააღმდეგი არ ვართ...", "სასამართლო სისტემაში ერთიანი <b>ქოლ-ცენტრი</b> ამოქმედდა", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("203", "ხალიჩისებური დაბომბვა", "", "", "ხალიჩისებური", "A", "", "დაბომბვა", "S", "C", "", "<b>ხალიჩისებური დაბომბვა</b> ეწოდება საჰაერო დაბომბვის ტიპს, რომლის დროსაც, გამიზნული ტერიტორიის ყოველი ნაწილისთვის ხდება ზიანის მიყენება.", "თავის მხრივ, <b>ხალიჩისებური დაბომბვა</b> არის ე.წ ფართობის დაბომბვის სახესხვაობა (Area bombardment), რომელიც გულისხმობს, განურჩეველ საჰაერო დაბომბვას (განურჩეველში იგულისხმება, რომ ტერიტორიაზე ნებისმიერი რამის განადგურება ხდება, მათ შორის მშვიდობიანი მოქალაქეების).", "<b>ხალიჩისებური დაბომბვა</b> გამოვიყენეთ ჩვენც და რუსებმაც.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("204", "მობილური ტელეფონი", "", "", "მობილური", "A", "", "ტელეფონი", "S", "C", "", "<b>მობილური ტელეფონი</b> მაჩუქა, წინასწარ მოემზადებინა ჩემთვის.", "გადავწიე საბანი და <b>მობილური ტელეფონი</b> იყო.", "გადავწიე საბანი და <b>მობილური ტელეფონი</b> იყო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("205", "სარისკო მდგომარეობა", "", "", "სარისკო", "A", "", "მდგომარეობა", "S", "NC", "", "იმიტომ რომ ჰქონდა მსოფლიოში ყველაზე <b>სარისკო მდგომარეობა</b>...", "...ვინაიდან ქვეყანაში 'ძალიან <b>სარისკო მდგომარეობა</b>' იქმნება.", "ჯანდაცვის სამინისტრო თავის მხრივ, აგრძელებს ჯანდაცვის სექტორის სრულ მობილიზებას, რომ გადაზღვეული იყოს ყველა <b>სარისკო მდგომარეობა</b>, მოვახდინოთ ვირუსთან ეფექტური გამკლავება და დროული, სათანადო ზრუნვა ყველა იმ პაციენტზე, რომელიც დაფიქსირდება.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("206", "დახურული წიგნი", "", "", "დახურული", "A", "", "წიგნი", "S", "NC", "", "გაბრიელმა <b>დახურული წიგნი</b> ტუმბაზე დადო.", "მათი აზრით, ხანგრძლივად <b>დახურული წიგნი</b> იმაზე მეტყველებს, რომ ჩვენი თემი რეალურ სამყაროს შეესისხლხორცა.", "სიჭაბუკე – სუფთა ფურცელი; სიბერე – <b>დახურული წიგნი</b>; ქაღალდს შეუძლია გაგვაბედნიეროს და კიდეც გაგვაუბედუროს...", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("207", "კომპიუტერული პროგრამა", "", "", "კომპიუტერული", "A", "", "პროგრამა", "S", "C", "", "ეს <b>კომპიუტერული პროგრამა</b> ამერიკელებმა დაგვიყენეს.", "სექტორისა (ანუ ოთახის) და ადგილის ნომერს არჩევს სპეციალური <b>კომპიუტერული პროგრამა</b>. ", "ამ ინფორმაციის გაშიფვრისათვის კი საჭიროა სპეციალური <b>კომპიუტერული პროგრამა</b> და საკმაოდ ბევრი დრო.", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("208", "სამზარეულოს ღუმელი", "", "", "სამზარეულოს", "N", "", "ღუმელი", "S", "PC", "", "დიდი <b>სამზარეულოს ღუმელი</b> შიშინებდა, ქანდარებზე ჯერ კიდევ ეძინათ ქათმებს...", "<b>სამზარეულოს ღუმელი</b> , რომელსაც ხშირად უწოდებენ უბრალოდ ღუმელს ან გაზქურას , არის სამზარეულოს მოწყობილობა , რომელიც შექმნილია საკვების მოსამზადებლად .", "როგორ დავასუფთავოთ <b>სამზარეულოს ღუმელი</b> ?", "არის", "აქვს", "", "", "", "<!--X-->");
INSERT INTO nctti_ka_mwes (id,compound,source,a_modif,modifier,modif_pos,a_head,head,number,comp,frequkWaC,examplesent1,examplesent2,examplesent3,be,have,undefdet_head,undefdet_compound,relatedto_modifier,something_modifier) VALUES ("209", "ბამბის ნაყინი", "", "", "ბამბის", "N", "", "ნაყინი", "S", "PC", "", "ხელიხელჩაკიდებულებმა <b>ბამბის ნაყინი</b> ისე შეუკვეთეს, რომ გოგონა ვერ იცნეს.", "არა! დღეს მეამ იყიდა თეთრი <b>ბამბის ნაყინი</b>. ", "ნინცას <b>ბამბის ნაყინი</b> ვუყიდე და სახლში ავიყვანე.", "არის", "აქვს", "", "", "", "<!--X-->");
